INSERT INTO `asesoria` (`codigo`, `titulo`, `descripcion`, `fecha_creacion`, `fecha_actualizacion`, `estado`) VALUES
(20, '<b>ASESORÍA TÉCNICA</b>', 'Análisis de Planos (Viabilidad Operacional). <br>\r\nAsesoría cumplimiento normas de los organismos certificadores. <br>\r\nDefinición de necesidades operacionales vinculadas a la arquitectura y decoración. <br>\r\n', NULL, NULL, 1),
(21, '<b>ASESORÍA COMERCIAL</b>', 'Análisis de Competencia.<br>\r\nEstudio de Mercado.<br>\r\nSegmentación de Mercado.<br> \r\nCanales de Venta y Market Mix.<br>\r\nDefinición de Imagen.<br>\r\nReclutamiento y fuerza de ventas.<br>\r\nCoaching a fuerza de ventas.<br>\r\nDiseño y definición de herramientas de gestión y control de ventas.<br>\r\nPresupuesto Comercial y de Marketing  .<br>\r\n', NULL, NULL, 1),
(22, '<b>ASESORÍA ADQUISICIONES</b>', 'Definición de equipamiento para cada área ( OS&E).<br>\r\nProceso Selección de Proveedores.<br>\r\nDefinición de Stock.<br>\r\nAlmacenaje y Bodegaje.<br>\r\nDefinición de bases para licitaciones y/o compras planificadas / oportunas.<br>\r\n\r\n', NULL, NULL, 1),
(23, '<b>ASESORÍA IT Y COMUNICACIONES</b>', 'Gestión de Sistemas.<br>\r\nEquipamiento.<br>\r\nInfraestructura.<br>\r\nTelecomunicaciones.<br>\r\nServicios Plus.<br>\r\nAdministración y soporte.<br>\r\nSalida en vivo.<br>\r\n', NULL, NULL, 1),
(24, '<b>ASESORÍA RECURSOS HUMANOS</b>', 'Misión, Visión, Valores y Cultura Organizacional.<br>\r\nHeadcount y Presupuesto de dotación.<br>\r\nOrganigramas.<br>\r\nDescripciones y Especificaciones de Cargo.<br>\r\nAsesoría en Reclutamiento de Personal.<br>\r\nDefinición de Herramientas de Selección.<br>\r\nAsesoría en Selección de Gerentes.<br>\r\nPrograma de Reconocimiento a Personal.<br> \r\nPlanes de Inducción y capacitación inicial para los diferentes puestos.<br>\r\nAsesoría en elaboración de plan de capacitación para el personal.<br>\r\nReglamento Interno y Manuales del Empleado.<br>\r\n', NULL, NULL, 1),
(25, '<b>ASESORÍA PREAPERTURA</b>', 'Determinar cronograma de actividades de preapertura.<br>\r\nAsesoría en subcontratación de empresas prestadoras de servicios.<br>\r\nAsesoría en la confección de Manuales de Procedimientos para cada área Operacional.<br>\r\nAplicación de procedimientos diferenciadores de calidad de servicio.<br>\r\nAsesoría en el Proceso de desarrollo de Presupuestos.<br>\r\nDesarrollo Programa de Reconocimiento y Fidelización de  Huéspedes (encuestas, análisis, control y seguimiento).<br>\r\n', NULL, NULL, 1),
(26, '<b>CLIENTE INCÓGNITO</b>', 'Reunión de Coordinación. <br> \r\nTraspaso de información. <br> \r\nConsideración de escenarios especiales solicitados por el cliente. <br>\r\nConfección de encuesta y protocolo de evaluación, según las necesidades del cliente. <br>\r\nEvaluación,Generación de Informe y Recomendaciones. <br> \r\n', NULL, '2021-08-04 01:38:53', 1);
