INSERT INTO `inscribete` (`codigo`, `titulo`, `descripcion`, `link`, `boton`, `banner`, `fecha_creacion`, `fecha_actualizacion`, `estado`) VALUES
(4, 'Capacitación Ejecutiva en linea', 'Ofrecemos 4 cursos de Capacitación Ejecutiva en linea para profesionales de Eventos y Hotelería', 'www.nouneventos.com.ar', 'Ingresar a NOUN', 'banner/LOGO_CMYK_02.png', NULL, NULL, 1),
(6, 'Nueva Alianza con American Hospitality Academy', 'Nos complace anunciar nuestra nueva Alianza con American Hospitality Academy para  cursos en linea en español destinados al  rubro de la hospitalidad. Capacítate a través de Talent to Serve y obtén un 40 % de descuento sobre el precio original.', 'www.ahaworldcampus.com', 'Ingresa a AHA', 'banner/world Campus online logo.jpg', NULL, NULL, 1),
(11, 'aa1', 'aad2', 'dddd3', 'a4', 'banner/5d7a4717fedbb66ca28878f5_68747470733a2f2f63646e2d696d616765732d312e6d656469756d2e636f6d2f6d61782f313630302f302a326953675f627777646131765f514569.png', NULL, '2021-08-04 19:28:53', 1);
INSERT INTO `networking` (`codigo`, `titulo`, `descripcion`, `fecha_creacion`, `fecha_actualizacion`, `estado`) VALUES
(11, 'Capacitación Prof. en Ceremonial y Protocolo', 'Duración: 6 meses de cursado online\r\n \r\nUnidad 01: Imagen Personal y Profesional\r\n \r\n1.1 Análisis de la imagen personal 1.2 El ceremonial y los aportes a 1.3 Normas de Urbanidad. 1.4 El vestuario: cómo vestirnos de acuerdo a cada ocasión.\r\n \r\nUnidad 02: Tratamiento \r\n \r\n2.1 Usos de la fórmula “Señor y Don”. 2.2 Precedencias. 2.3 Presentaciones. 2.4 Ley de la Derecha 2.5 Ley de Precedencia \r\n \r\nUnidad 03: Símbolos Patrios\r\n \r\n3.1 Normas protocolares. 3.2 Bandera Nacional y extranjera. 3.3 Símbolos y banderas empresariales. 3.4 Comportamiento cívico.\r\n \r\nUnidad 04: Reuniones y Eventos\r\n \r\n4.1 Eventos y sus horarios. Características que los distinguen. 4.2 Mesa americana 4.3 El Menú \r\n \r\nUnidad 05: Mesas \r\n \r\n5.1 Mesas a la francesa o inglesa 5.2 Decoración. 5.3 El lenguaje de los cubiertos', NULL, NULL, 1),
(12, 'Capacitación Prof. en Planificación de Bodas ', 'Duración: 06 meses de cursado online \r\n \r\n \r\nUnidad 01: Introducción \r\n \r\n1.1 Evolución histórica de la celebración matrimonial. 1.2 Tipos de bodas: diferentes culturas. 1.3 Perfil del Wedding Planner, importancia de sus servicios. Honorarios. 1.4 Bodas de celebridades. \r\n \r\nUnidad 02: Planificación \r\n \r\n2.1 Invitaciones: redacción, clasificación, envíos, confirmación. Lista de obsequios. 2.2 La sede para el evento, ambientación, mobiliario, arreglos florales. 2.3 Servicios necesarios del evento: música, iluminación, cotillón, fotógrafo, video, proyecciones, seguridad. 2.4 Banquete: mesas, ubicación de los invitados, menú, bebidas, torta nupcial. \r\n \r\nUnidad 03: Vestimenta y detalles de los novios \r\n \r\n3.1 Ajuar de la novia: vestido, calzado, tocado, maquillaje, joyas. 3.2 Vestimenta del novio: elección del traje, botonier. 3.3 Detalles: las alianzas, el ramo de la novia, el velo. 3.4 Indumentaria de los padrinos y demás invitados. \r\n \r\nUnidad 04: Ceremonia civil y religiosa \r\n \r\n4.1 Ceremonia civil: requisitos, documentación, análisis prenupciales, testigos. 4.2 Agenda nupcial: paso a paso de las actividades a realizar en el casamiento. 4.3 Boda religiosa: protocolo de la ceremonia, cortejo, ingreso de los novios, marcha nupcial, coros. 4.4 Tradiciones de la ceremonia: coche nupcial, lanzar arroz, las arras. \r\n \r\nUnidad 05: La celebración \r\n \r\n5.1Planificación de los festejos. 5.2 La recepción.  5.3 Luna de miel. \r\n \r\n \r\nUnidad 06: Aspectos generales \r\n \r\n6.1 Las tendencias sobre bodas. \r\n ', NULL, NULL, 1),
(13, ' Inglés para Organizadores de Eventos ', 'Duración 9 meses cursado online\r\nUNIDAD 1: Activities \r\n \r\n1- Vocabulario especifico - Presente simple. 2- Presentación personal. 3- Como escribir correo electrónico. \r\n \r\nUNIDAD 2: Etiquette \r\n \r\n1- Vocabulario especifico adjetivos. 2- Lenguaje formal o informal. 3- Frases formales- como escribir notas y menajes cortos. \r\n \r\nUNIDAD 3: Image \r\n \r\n1- Vocabulario especifico. 2- Como vender un producto.  3- Como escribir memos. \r\n \r\nUNIDAD 4: Success \r\n \r\n1- Vocabulario especifico. 2- Pasado simple. Hablar de situaciones pasadas. 3- Expresiones en pasado. \r\n \r\nUNIDAD 5.: Location \r\n \r\n1- Vocabulario especifico. 2- Futuro- organizar planes. 3- Organizar encuentros, reuniones. \r\n \r\nUNIDAD 6: Job-Seeking \r\n \r\n1- Vocabulario especifico. 2- Miembros de una empresa- jerarquías. 3- Como elaborar CV y como escribir cartas. \r\n \r\n\r\n \r\nUNIDAD 7: Creativity \r\n \r\n1- Vocabulario especifico. 2- Desarrollando la creatividad de una empresa. 3- Soluciones creativas. \r\n \r\nUNIDAD 8: Motivation \r\n \r\n1- Vocabulario especifico. 2- La motivación y los empleados. ', NULL, NULL, 1),
(14, 'Capacitación Prof. en Organización de Eventos', ' \r\nDuración: 09 meses de cursado online \r\n \r\n1er. segmento: 5 meses \r\n \r\nORGANIZACIÓN DE EVENTOS I  Introducción a la Organización de eventos: las tres etapas fundamentales del proceso organizativo. La creación de la empresa organizadora de eventos. Factores claves,  La importancia del uso de tecnología en la empresa organizadora de eventos.  La venta de mi empresa organizadora de eventos: pasos a seguir.  Eventos empresarios: conferencias, debates y foros, lanzamientos, reuniones de trabajo, etc. \r\n \r\nCEREMONIAL, PROTOCOLO & RR.PP. I  - Formación de redes de negocios y contactos. - Presentación en el mercado tanto de la empresa como uno mismo. - Estudio de las reglas del buen vestir. - Estudio del lenguaje corporal. - Análisis de las reglas de precedencia y presidencia. - El ceremonial de la mesa. - Ordenamiento de banderas. Estudio de los símbolos patrios, etc. \r\n \r\nMONTAJE Y AMBIENTACIÓN   Principios arquitectónicos comunes a los eventos  Disposiciones municipales y nacionales sobre seguridad en el montaje de eventos.  Ambientación: teoría de los colores. Géneros. Mobiliarios. Paisajismo, etc. \r\n \r\n \r\n2do. segmento: 4 meses \r\n \r\nORGANIZACIÓN DE EVENTOS II  Organización de eventos sociales: fiestas, bodas, recepciones, cocktails, etc. Organización de eventos culturales: vernissages, \r\nOrganización de eventos comerciales: congresos, ferias, exposiciones, lanzamientos de productos, etc. Análisis de los contratos ligados a la organización de eventos: arrendamientos feriales, personal eventual, locación de servicios, seguros, etc. \r\n \r\nCEREMONIAL, PROTOCOLO & RR.PP. II   Ceremonial empresario: organización de reuniones, relaciones con la prensa.  Etiqueta. Presentaciones. Tipos de saludos.  Tratamiento de autoridades. ? Comportamiento en una mesa: anfitrión y/o invitado perfecto. \r\n \r\nPRENSA Y COMUNICACIÓN  - Redacción de cartas solicitando habilitaciones municipales, sponsorías, declaraciones de interés nacional/provincial y auspicios, etc. - Redacción de discursos de inauguración y bienvenida. - Redacción de partes de prensa. - Estudio de los diferentes medios de comunicación. - Planificación de campañas publicitarias, etc. \r\n \r\n ', NULL, NULL, 1),
(15, 'Curso Profesional de Hospitalidad', 'CPH consiste en seminarios centrados en la industria y actividades que enfatizan el desarrollo de rasgos, tanto de liderazgo personal como profesional, necesarios para tener éxito en la industria de la hospitalidad. Cuenta con el registro en South Carolina Commission on Higher Education en los Estados Unidos. Módulos y Seminarios:\r\nM1 Actitud M1 Carácter      \r\nM2 Entendiendo la Cultura M2 El Espíritu de Servicio        \r\nM3 Aspecto y Etiqueta M3 Asistencia Laboral y Administración del Tiempo  \r\nM4 Elementos de Servicio M4 Rompiendo los Estereotipos \r\nM5 Comunicación M5 Comunicación Transcultural  \r\nM6 Cooperación \r\nM7 Trabajo en Equipo \r\nM8 Abrace el Cambio      M8 Celebrando la Diversidad\r\n\r\n', NULL, NULL, 1);
INSERT INTO `op_practica` (`codigo`, `cargo`, `descripcion`, `link`, `hotel`, `fecha_creacion`, `fecha_actualizacion`, `estado`) VALUES
(8, 'Alumno en Práctica para Housekeeping', 'Requerimos incorporar alumno en práctica para nuestro departamento de Housekeeping para el periodo de Septiembre, Octubre y Noviembre 2015.\r\nFunciones: \r\nLimpieza habitaciones del hotel.\r\nOrganizar y distribuir el trabajo de Mucamas, Aseadores y Lavandería.\r\nAsegurar que el trabajo esté realizado bajo los estándares del hotel. Inspeccionar diferentes áreas.\r\nRevisar, coordinar y entregar habitaciones a Recepción.\r\nReportar a Ama de Llaves, noticias del día.Pincha el cargo al que quieres postular en el recuadro a la izquierda y postula directamente o envía tus antecedentes a rrhhsantiago@thesingular.com\r\n', 'rrhhsantiago@thesingular.com', 'Importante Hotel Sector Lastarria', '2015-07-20 00:00:00', NULL, 1);
INSERT INTO `op_trabajo` (`codigo`, `cargo`, `descripcion`, `link`, `hotel`, `web`, `banner`, `fecha_creacion`, `fecha_actualizacion`, `estado`) VALUES
(57, 'Jefe de Recepción', 'Administrador Hotelero o similar, al menos 2 años de experiencia liderando equipos de recepción, disponibilidad de trabajo en turnos, excelencia en servicio, inglés fluido, manejo en sistemas hoteleros. Manda tus antecedentes a rrhh@solacehotel.cl o pincha en postular.', 'rrhh@solacehotel.cl', 'Apertura Hotel Solace Providencia', '', 'banner/solace.jpg', '2015-12-24 00:00:00', NULL, 1),
(58, 'Ejecutivo Comercial para Oficina Stgo', 'Responsable de la venta de habitaciones y servicios de hoteles a través de la captación, mantención  y gestión con clientes de empresas corporativas, de turismo, OTA, Portales on line y/o agencias corporativas clientes potenciales nuevos y/o cautivos\r\nHabilidades y competencias:Visión y Orientación de Negocios.Persuasión,\r\nServicio de Hotelería con Calidad y Calidez, Compromiso de Eficiencia, Comunicación y Trabajo en Equipo, Iniciativa, Prolijidad – Orientación a los Detalles, Responsabilidad, Tolerancia a la Presión, Excel, Word y Power Point a nivel medio, Inglés hablado y escrito. Manda tus antecedentes a postulaciones@hdl.cl\r\n\r\n ', 'postulaciones@hdl.cl', 'Prestigiosa Empresa Hotelera del Sur ', '', 'banner/hotel.jpg', '2015-12-28 00:00:00', NULL, 1),
(59, 'Recepcionista Turno Tarde', 'Hotel Boutique dentro de Viña en Alto Jahuel  necesita una persona recibida o por recibirse de las carreras de turismo/hotelería, conocimientos de inglés medio, computación y experiencia en sistema hotelero opera o similar. Buena disposición para aprender y dar una atención de calidad al huésped de alto perfil, manejar el check in y check out y facturación. Se considerará importante la experiencia previa y la buena presencia.Enviar CV a contacto@talenttoserve.com\r\n', 'contacto@talenttoserve.com', 'Hotel Boutique de Viña en Alto Jahuel', '', 'banner/hotel.jpg', '2016-01-08 00:00:00', NULL, 1),
(60, 'Cocinero', 'Hotel boutique dentro de Viña en Alto Jahuel, busca Cocinero con estudios de alta gastronomía y experiencia mínima de 5 años en cocina gourmet.\r\nSe necesita una persona recibida en la carrera de gastronomía, para la elaboración y producción de menús de estilo mediterráneo y francés, con capacidad de trabajar bajo las órdenes directas de la gerencia en el servicio de cocina para huéspedes exigentes. Sexo masculino, edad de 30 a 35 años.\r\nEnviar CV a contacto@talenttoserve.com\r\n', 'contacto@talenttoserve.com', 'Hotel Boutique de Viña en Alto Jahuel', '', 'banner/hotel.jpg', '2016-01-08 00:00:00', NULL, 1),
(61, 'Mucama', 'Hotel The Singular Santiago ubicado en barrio Lastarria busca personal para el puesto de Mucama. Requisitos: mayor de 30 años. Turnos rotativos. No se requiere experiencia previa. Se requiere gran sentido de responsabilidad, honorabilidad y trabajo en equipo. Salud compatible al cargo de trabajo. Para postulaciones, favor enviar el CV a postulaciones@thesingular.com indicando en el asunto el cargo al que postula \r\n\r\n', 'postulaciones@thesingular.com', 'Hotel The Singular Santiago', 'www.thesingular.com', 'banner/singular tts.jpg', '2016-01-08 00:00:00', NULL, 1),
(62, 'Pastelero/a', 'Hotel The Singular Santiago ubicado en barrio Lastarria busca personal para el puesto de Pastelero/a. Requisitos: Experiencia previa mínimo 2 años. Turnos rotativos.  Se requiere gran sentido de responsabilidad, compromiso y trabajo en equipo. Para postulaciones, favor enviar el CV a postulaciones@thesingular.com indicando en el asunto el cargo al que postula ', 'postulaciones@thesingular.com', 'Hotel The Singular Santiago', 'www.thesingular.com', 'banner/singular tts.jpg', '2016-01-08 00:00:00', NULL, 1),
