(64, 'Garzon/a', 'Hotel The Singular Santiago ubicado en barrio Lastarria busca personal para el puesto de Garzon/a. Requisitos: Idioma inglés excluyente. Experiencia mínima 1 año en puestos de trabajos similares.  Se requiere gran sentido de responsabilidad, honorabilidad y trabajo en equipo.  Para postulaciones, favor enviar el CV a postulaciones@thesingular.com indicando en el asunto el cargo al que postula \r\n', 'postulaciones@thesingular.com', 'Hotel The Singular Santiago', 'www.thesingular.com', 'banner/singular tts.jpg', '2016-01-08 00:00:00', NULL, 1),
(65, 'Aseador/a', 'Hotel The Singular Santiago ubicado en barrio Lastarria busca personal para el puesto de Aseador/a. Requisitos: Turnos rotativos. No se requiere experiencia previa. Se requiere gran sentido de responsabilidad, honorabilidad y trabajo en equipo. Salud compatible al cargo de trabajo. Para postulaciones, favor enviar el CV a postulaciones@thesingular.com indicando en el asunto el cargo al que postula \r\n', 'postulaciones@thesingular.com', 'Hotel The Singular Santiago', 'www.thesingular.com', 'banner/singular tts.jpg', '2016-01-08 00:00:00', NULL, 1),
(66, 'Auditor Nocturno', 'Hotel Boutique ubicado en Valparaíso requiere auditor nocturno. Persona responsable, con espíritu de servicio. Inglés intermedio. Entre sus labores debe realizar la auditoría de las ventas realizadas por hotel y restaurante, cargo de tarifas, revisión de cuentas, facturación de agencias, procedimiento de check-in y check-out, responder emails, atender a los huéspedes. Deseable licencia de conducir. Enviar cv a rrhhvalpo@hotmail.com, indicando pretensión de renta\r\n ', 'rrhhvalpo@hotmail.com', 'Hotel Boutique Valparaíso', '', 'banner/hotel tts.jpg', '2016-01-20 00:00:00', NULL, 1),
(67, 'Recepcionistas', 'Persona recibida o por recibirse de las carreras de turismo/hotelería, conocimientos de inglés, computación y experiencia en sistema hotelero Opera o similar. Buena disposición para aprender y dar una atención de calidad al huésped de alto perfil.Manda tus antecedentes a rrhh@solacehotel.cl o pincha en postular.  \r\n ', 'rrhh@solacehotel.cl', 'Apertura Hotel Solace Providencia', 'www.solacehotel.cl', 'banner/solace.jpg', '2016-01-29 00:00:00', NULL, 1),
(68, 'Ejecutiva de Ventas Corporativa Senior  ', 'Responsable de la venta de habitaciones y servicios del Hotel.  Habilidades y competencias:Visión y Orientación de Negocios.Persuasión, Servicio de Hotelería con Calidad y Calidez, Compromiso de Eficiencia, Comunicación y Trabajo en Equipo, Iniciativa, Prolijidad – Orientación a los Detalles, Responsabilidad, Tolerancia a la Presión, Excel, Word y Power Point a nivel medio. Persona con cartera de clientes y  disposición a viajar.Manda tus antecedentes a rrhh@solacehotel.cl o pincha en postular.\r\n\r\n', 'rrhh@solacehotel.cl', 'Apertura Hotel Solace Providencia', 'www.solacehotel.cl', 'banner/solace.jpg', '2016-01-29 00:00:00', NULL, 1),
(69, 'Sous Chef', 'Buscamos una persona para gestionar,  supervisar  y/o elaborar, decorar y presentar los distintos servicios además de organizar operacionalmente las actividades al interior de la cocina según los estándares establecidos.\r\nEstudios Técnicos Gastronómicos de al menos 3 años en Cocina Internacional. Experiencia mínima de 3 años en cargos similares y de al menos 10 años en el rubro. Experiencia en Hoteles  (todos los servicios) y restaurantes. Experiencia en cocciones Sous Vide, cocina mediterránea. Manda tus antecedentes a rrhh@solacehotel.cl o pincha en postular. \r\n ', 'rrhh@solacehotel.cl', 'Apertura Hotel Solace Providencia', 'www.solacehotel.cl', 'banner/solace.jpg', '2016-02-11 00:00:00', NULL, 1),
