(76, 'Supervisor de Alimentos y Bebidas', 'Responsable de coordinar, programar, dirigir, controlar y supervisar el accionar de todos los garzones y barmen para entregar un servicio de acuerdo a los estándares establecidos. Realiza inventarios y controla el Big Four. Realiza acciones de fidelización con los clientes y asiste al gerente en la realización de turnos y reclutamiento de personal. Manda tus antecedentes indicando el cargo al que postulas a pborges@talenttoserve.com o pincha en postular. ', 'pborges@talenttoserve.com', 'Importante Hotel 5 estrellas Santiago', '', 'banner/hotel tts.jpg', '2016-03-06 00:00:00', NULL, 1),
(78, 'Anfitriona de bar', ' Idioma inglés excluyente. Experiencia mínima 1 año en puestos de trabajos similares de atención al cliente.  Se requiere gran sentido de responsabilidad, buenas relaciones interpersonales y trabajo en equipo. \r\nHorario: de 16.30 a 00.30 hs. Para postulaciones, favor enviar el CV a postulaciones@thesingular.com indicando en el asunto el cargo al que postula ', 'postulaciones@thesingular.com', 'Hotel The Singular Santiago', 'www.thesingular.com', 'banner/singular tts.jpg', '2016-04-04 00:00:00', NULL, 1),
(79, 'Anfitriona de Restaurant', 'Buscamos una persona con experiencia previa en el cargo, manejo del idioma inglés, buena presencia, disponibilidad horaria, pro activa, buenas relaciones humanas, manejo de conflictos.Postula directamente pinchando en postular o envía tus antecedentes a selecoperadoraversalle@gmail.com', 'selecoperadoraversalle@gmail.com', 'Hotel Boutique Rugendas Sector El Golf', 'www.rugendas.cl', 'banner/Logo Rugendas.jpg', '2016-04-07 00:00:00', NULL, 1),
(80, 'Supervisor de Alimentos y Bebidas', 'Experiencia previa en el cargo, manejo del idioma inglés, disponibilidad horaria, manejo y coordinación de equipos de trabajo, manejo de conflictos, manejo de office, pro activo, ideal manejo del sistema hotelero CM. Postula directamente pinchando en postular o envía tus antecedentes a selecoperadoraversalle@gmail.com', 'selecoperadoraversalle@gmail.com', 'Hotel Boutique Rugendas Sector El Golf', 'www.rugendas.cl', 'banner/Logo Rugendas.jpg', '2016-04-07 00:00:00', NULL, 1),
(81, 'Recepcionistas', 'Hotel Luciano K busca para su pronta apertura persona con un mínimo dos años de experiencia en cargo similar, manejo de idioma inglés.Postula directamente en el botón postular o envía tus antecedentes a jpbeaujanot@lucianokhotel.com', 'jpbeaujanot@lucianokhotel.com', 'Apertura Luciano K Hotel Boutique', 'www.lucianokhotel.com', 'banner/Luciano K logo(1).jpg', '2016-04-12 00:00:00', NULL, 1),
(82, 'Supervisor de Restaurant', 'Se requiere  experiencia previa comprobable en restaurante de hoteles. \r\nHabilidades de liderazgo en manejo de grupos. Inglés fluído. \r\nDisponibilidad fulltime. Vocación de servicio y orientado a las ventas. Postula directamente en el botón postular o envía tus antecedentes a roberto.laurel@ihg.com\r\n', 'roberto.laurel@ihg.com', 'Hotel Crowne Plaza Santiago', 'www.crowneplaza.com', 'banner/crowne-plaza.gif', '2016-04-18 00:00:00', NULL, 1),
(83, 'Supervisor de Bar', 'Se requiere experiencia previa comprobable en el bar de hoteles. Habilidades de liderazgo en manejo de grupos. Inglés fluído. Disponibilidad fulltime. Vocación de servicio y orientado a las ventas. Postula directamente en el botón postular o envía tus antecedentes a roberto.laurel@ihg.com ', 'roberto.laurel@ihg.com', 'Hotel Crowne Plaza Santiago', 'www.crowneplaza.com', 'banner/crowne-plaza.gif', '2016-04-18 00:00:00', NULL, 1),
(84, 'Supervisor de Alimentos y Bebidas', 'Se requiere experiencia previa comprobable en Alimentos y Bebidas. Habilidades de liderazgo, Inglés fluído. Vocación de servicio y conocimiento en maridaje y vinos. Manda tus antecedentes a rrhh@solacehotel.cl o pincha en postular.', 'rrhh@solacehotel.cl', 'Apertura Hotel Solace Providencia', 'www.solacehotel.cl', 'banner/solace.jpg', '2016-04-25 00:00:00', NULL, 1),
(85, ' Recepcionista y Travel&Tours', 'Buscamos profesional graduado de carrera técnica turística, con al menos 1 año de experiencia en hotelería y/o agencias de viaje, con dominio idioma inglés hablado y escrito, para desempeñarse como Recepcionista y conserjería Travel & Tours de Weskar Lodge Hotel, ubicado en la ciudad de Puerto Natales, cercano al Parque Nacional Torres del Paine. Ofrecemos alojamiento en la ciudad de Puerto Natales. El cargo requiere asistencia a los huéspedes en lo relativo a los servicios del hotel, preventa de servicios de tours y conserjería. Enviar curriculum con pretensiones de renta a marketing@weskar.cl\r\n', 'marketing@weskar.cl', 'Weskar Patagonian Lodge, Puerto Natales.', 'www.weskar.cl', 'banner/wekar.jpg', '2016-05-03 00:00:00', NULL, 1),
(86, 'Housekeeper Hotel', 'Buscamos Housekeeper con 3 años o más de experiencia en cargo similar, idioma inglés avanzado, experiencia en hotelería 5 estrellas y con foco 100% orientado al cliente interno como externo. Manda tus antecedentes a searchsantiago@gmail.com o pincha en postular.\r\n\r\n', 'searchsantiago@gmail.com', 'Hotel 5 Estrellas Santiago', '', 'banner/hotel tts.jpg', '2016-05-17 00:00:00', NULL, 1),
(87, 'Cocinero/a', 'Buscamos persona con experiencia, al menos dos años, disposición a trabajar con turnos, proactivo, vocación de servicio, ojalá que maneje el inglés, dispuesto a contribuir para nuevas metas del área y con servicio para atender clientes y huéspedes chilenos y extranjeros. Manda tus antecedentes a gcampos@lastarriahotel.com o pincha en postular. ', 'gcampos@lastarriahotel.com', 'Lastarria Boutique Hotel', 'www.lastarriahotel.com', 'banner/logo-lastarria-new-1.png', '2016-07-06 00:00:00', NULL, 1),
(88, 'Garzon/a', 'Personalidad agradable y excelente actitud de servicio. Buenas Habilidades de comunicación, organización y entusiasmo. Poseer espíritu de trabajo en equipo.\r\nFlexibilidad, Unidad e Iniciativa.Experiencia en Servicio de F&B de excelencia (Experiencia en hoteles 5* / Restaurants de categoría / Cruceros). Estudios Referidos a Administración Hotelera / Restauración o Sommelería.\r\nExcelente presencia. Excelente Dominio del Idioma Inglés (Excluyente).\r\nManejo del idioma Portugués (Preferentemente)\r\nLugar de Trabajo: Millahue, VI Región. Alojamiento ( compartido), comidas y lavandería proporcionados.Manda tus antecedentes a sfiere@vik.cl o pincha en postular. \r\n', 'sfiere@vik.cl', 'Hotel Viña Vik', 'www.vinavik.com', 'banner/Logo viña vik.jpg', '2016-07-07 00:00:00', NULL, 1),
(89, 'Garzon/a', 'Idioma inglés excluyente. Experiencia mínima 1 año en puestos de trabajos similares.  Se requiere gran sentido de responsabilidad, honorabilidad y trabajo en equipo. Para postulaciones, favor enviar el CV a postulaciones@thesingular.com indicando en el asunto el cargo al que postula o pinchar en postular.', 'rrhhsantiago@thesingular.com', 'Hotel The Singular Santiago', 'www.thesingular.com', 'banner/logo singular.jpg', '2016-08-10 00:00:00', NULL, 1),
(90, 'Mucama Turno Tarde', 'Mucama responsable de turno tarde con un alto espíritu de orientación al servicio, íntegra, capacidad de trabajar bajo presión, motivada,habilidades de cooperación y dominio de inglés medio. Para postulaciones, favor enviar el CV a postulaciones@thesingular.com indicando en el asunto el cargo al que postula o pinchar en postular.\r\n', 'postulaciones@thesingular.com', 'Hotel The Singular Santiago', 'www.thesingular.com', 'banner/singular tts.jpg', '2016-08-18 00:00:00', NULL, 1),
(92, 'Cocinero Nocturno', 'Cocinero nocturno, funciones especialmente relacionadas a preparación de desayunos y Room Service. Para postulaciones, favor enviar el CV a postulaciones@thesingular.com indicando en el asunto el cargo al que postula o pinchar en postular. ', 'postulaciones@thesingular.com', 'Hotel The Singular Santiago', 'www.thesingular.com', 'banner/singular tts.jpg', '2016-08-18 00:00:00', NULL, 1),
(97, 'Recepcionista', 'Persona con al menos dos años de experiencia en el cargo, disposición para trabajar en turnos rotativos, proactivo, vocación de servicio y excelencia en el trato a los huéspedes, indispensable idioma ingles hablado y escrito, ojalá manejo de otro idioma. El cargo requiere atención a los huéspedes en lo que se refiere a los servicios del Hotel, venta de servicios y conserjería. Los interesados puedan postular de manera directa enviando el CV por email a: gcampos@lastarriahotel.com', 'gcampos@lastarriahotel.com', 'Lastarria Boutique Hotel', 'www.lastarriahotel.com', 'banner/logo-lastarria-new-1.png', '2016-08-22 00:00:00', NULL, 1),
(98, 'Recepcionista Part Time sábado/domingo', 'Atención y ayuda a huéspedes ,información turística, toma de servicios turísticos, taxis, etc., Check-in y Check-out, Atención telefónica y correo electrónico, Venta de habitaciones, Control de disponibilidad en OTAs , Cobro de boletas/facturas\r\nComunicación y coordinación directa con mucamas, Manda tus antecedentes a ltagle@heidelberghaus.cl o pincha en postular', 'ltagle@heidelberghaus.cl', 'Heidelberg Haus Apart Hotel', 'www.heidelberghaus.cl', 'banner/logo heidelberghaus.png', '2016-08-21 00:00:00', NULL, 1),
(99, 'Gerente para liderar operaciones Calama', 'Requisitos: Título Universitario, carrera de al menos  4 años con especialidad en gestión. Al menos 10 años de experiencia. Antecedentes personales intachables.\r\nHabilidades: Liderazgo de grupos. Orientación al logro. Planificación y organización. Resolución. Trabajo en equipo/ cooperación. Enviar CV con pretensiones de renta al email:  gerente207@gmail.com\r\n \r\n ', 'gerente207@gmail.com', 'Importante Holding Hotelero', '', 'banner/hotel tts.jpg', '2016-08-21 00:00:00', NULL, 1),
(100, 'Gerente de Operaciones y Servicio', 'Profesional del área hotelera o turismo con al menos dos años de experiencia en cargo similar, Capacidad de Liderar Equipos, Aplicación de Políticas y Procedimientos, Manejo de Excell y software hoteleros, Ingles hablado y escrito es requisito imprescindible, Alta orientación al servicio. Los interesados puedan postular de manera directa enviando el CV por email a: jmreyes@hotelismael312.com o pinchar en postular.\r\n\r\n', 'jmreyes@hotelismael312.com', 'Hotel Ismael 312', 'www.hotelismael312.com', 'banner/Logo Ismael 312.png', '2016-08-22 00:00:00', NULL, 1),
(101, 'Guest Service Agent', 'Experiencia de al menos 2 años en hotelería 5 estrellas, Experiencia en Lifestyle Hospitality y servicio personalizado (no excluyente), Idioma inglés y portugués oral y escrito. Los interesados pueden postular de manera directa enviando el CV por email a: rrhh@solacehotel.cl  o pinchar en postular. ', 'rrhh@solacehotel.cl', 'Hotel Solace ', 'www.solacehotel.cl', 'banner/logo solace.jpg', '2016-08-24 00:00:00', NULL, 1),
(102, 'Ejecutivo Tour & Travel y Grupos, base Stgo', 'Requiere incorporar a su equipo de trabajo a ejecutivo, con base en Santiago, que sea responsable de la venta de habitaciones y servicios a través de la captación, mantención y gestión con clientes de empresas de turismo, Tour Operadores, Agencias de Viaje de Turismo y Corporativas, Empresas y Corporaciones, Productoras y Empresas Organizadoras de Eventos, Portales On line, clientes potenciales nuevos y/o cautivos. De Formación, Técnico nivel medio en administración de empresas hoteleras y/o turismo, que cuente con 2 a 3 años de experiencia en cargos similares, con conocimientos de computación nivel medio.Idiomas: inglés hablado y escrito + portugués nivel medio. Enviar CV y pretensiones de Renta a: cvsingulares@gmail.com o pincha en postular.\r\n', 'cvsingulares@gmail.com', 'Hotel del Sur de Chile', 'www.singulares.com', 'banner/logo singulares2.jpg', '2016-08-29 00:00:00', NULL, 1),
(103, 'Asistente Gerencia Comercial, base Stgo', 'Requiere incorporar a su equipo de trabajo a ejecutivo, con base en Santiago, a persona para asistir a la gerente comercial y al equipo comercial, apoyándolos en el desarrollo y gestión del departamento. Con Visión y Orientación de Negocios, Servicio de Hotelería con Calidad y Calidez, Compromiso de Eficiencia,Comunicación y Trabajo en Equipo, Iniciativa, Prolijidad – Orientación a los Detalles, Responsabilidad y Tolerancia a la Presión. De Formación, Técnico de nivel medio en administración de empresas de turismo, que cuente con 2 a 3 años de experiencia en cargos similares, RRPP, relacionados con el área hotelera y/o turismo. Conocimientos de computación nivel medio.Idioma: Inglés nivel Medio. Enviar CV y pretensiones de Renta a: cvsingulares@gmail.com o pincha en postular.\r\n\r\n', 'cvsingulares@gmail.com', 'Hotel del Sur de Chile', 'www.singulares.com', 'banner/logo singulares 2.jpg', '2016-08-29 00:00:00', NULL, 1),
(104, 'Mucama', 'Buscamos mucama responsable para turnos rotativos con un alto espíritu de orientación al servicio, capacidad de trabajar bajo presión, motivada, habilidades de cooperación y dominio de inglés medio. Para postulaciones, favor enviar el CV a rfredes@hotelismael312.com indicando en el asunto el cargo al que postula o pinchar en postular.\r\n', 'rfredes@hotelismael312.com', 'Hotel Ismael 312', 'www.hotelismael312.com', 'banner/Logo Ismael 312.png', '2016-09-06 00:00:00', NULL, 1),
(105, 'Gerente de Hotel', 'Requiere incorporar a su equipo de trabajo a Gerente de Hotel, con base en Puerto Varas, que sea responsable de dirigir, controlar, planificar, coordinar, analizar el trabajo de la gerencia de operaciones y comercial del Hotel. Que tenga visión y orientación a los negocios, compromiso con la eficiencia, Servicio de hotelería con calidad y calidez. De Formación, Técnico nivel superior en administración Hotelera o Empresas de Turismo, con Diplomado en Gestión de Empresas, que cuente con 5 a 6 años de experiencia en dirección y gerenciamiento de empresas, con conocimientos de computación nivel avanzado. Idiomas: inglés nivel medio.Enviar cv y pretensiones de Renta a: cvsingulares@gmail.com o pinchar en postular\r\n', 'cvsingulares@gmail.com', 'Hotel Sur de Chile', 'www.singulares.com', 'banner/logo singulares2.jpg', '2016-09-12 00:00:00', NULL, 1),
(106, 'Garzón/a de desayuno buffet part time', 'Buscamos persona para atender desayuno en cafetería en modo part time. Las funciones son montaje y desmontaje de mesas, montaje y reposición de alimentos, lavado y secado de loza, atención mínima al huésped y recogida de la cafetería. Se requiere persona responsable, puntual, educada, ordenada y con experiencia previa en el cargo. Horario y días de trabajo: Lunes y Viernes 6:30 am - 11:30 am, Sábado y Domingo 7:30 am - 12:30 pm. Interesados mandar CV a ltagle@heidelberghaus.cl o pinchar en postular.\r\n', 'ltagle@heidelberghaus.cl', 'Heidelberg Haus Apart Hotel', 'www.heidelberghaus.cl', 'banner/logo heidelberghaus.png', '2016-09-15 00:00:00', NULL, 1),
(107, 'Ama de Llaves', 'The Singular Patagonia requiere incorporar de forma permanente y estable a Ama de Llaves. Responsabilidades:  \r\nOrganizar y coordinar las actividades del personal de piso, lavandería y aseo. Controlar la conformidad del trabajo basado en un estándar definido por la dirección del hotel. Contribuir ayudar y apoyar a  su equipo.Requisito:2 años en cago similar\r\nIdioma Inglés Beneficios: - Residencia en área del hotel- Almuerzo en Casino de Personal. Para postulaciones, favor enviar el CV a postulaciones@thesingular.com indicando en el asunto el cargo al que postula o pinchar en postular. ', 'postulaciones@thesingular.com', 'The Singular Patagonia', 'www.thesingular.com', 'banner/logo singular patagonia.jpg', '2016-10-07 00:00:00', NULL, 1),
(108, 'Maestro de Cocina', 'Se necesita persona para el puesto de maestro de cocina del Hotel, experiencia en el cargo, disponibilidad para trabajar en turnos rotativos de mañana y tarde, excelente servicio, responsable y con ganas de formar parte de un equipo con nuevos desafíos. Interesados enviar CV a gcampos@lastarriahotel.com o pinchar en postular.\r\n \r\n ', 'gcampos@lastarriahotel.com', 'Lastarria Boutique Hotel', 'www.lastarriahotel.com', 'banner/logo-lastarria-new-1.png', '2016-10-16 00:00:00', NULL, 1),
(109, 'Housekeeper ', 'Requisitos: Experiencia de al menos 2 años en Hotelería 5 estrellas,Experiencia liderando equipos de trabajo, Manejo de sistema operativo opera (no excluyente)\r\nConocimiento de idioma inglés (no excluyente) Tareas: Organizar y coordinar las actividades del personal de piso, lavandería y aseo. Controlar y supervisar los trabajos del departamento, garantizando que todas las tareas sean realizadas de manera eficiente, Llevar una correcta administración del área (inventarios, control de costos, manejo de RRHH) Los interesados pueden postular de manera directa enviando el CV por email a: rrhh@solacehotel.cl o pinchar en postular.\r\n\r\n \r\n ', 'rrhh@solacehotel.cl', 'Hotel Solace ', 'www.solacehotel.cl', 'banner/logo solace.jpg', '2016-10-16 00:00:00', NULL, 1),
(110, 'Encargada de SPA', 'Funciones principales: Planear los servicios y actividades que se ofrecen en el  SPA,\r\nRealizar los tratamientos en conjunto con el equipo para satisfacer las necesidades de relajación, estéticas y de belleza, Coordinar, formar y motivar a su equipo, Asegurar que los estándares de servicio sean siempre excelentes. Requisitos:  \r\nExperiencia mínima de 2 años como encargada de SPA, Masoterapeuta, Se valorará una formación en terapias naturales, Persona con capacidad de liderazgo, entusiasta y con compromiso con la empresa , Nivel avanzado de inglés, Dominio de Microsoft Office. Manda tu CV a pborges@talenttoserve.com indicando en asunto el cargo de encargado de Spa.', 'pborges@talenttoserve.com', 'Hotel Boutique', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2016-10-18 00:00:00', NULL, 1),
(113, 'Jefe Recepción Hostal', 'Hostal ubicado en Barrio Bellavista con excelente posicionamiento en la web, busca a su jefe de recepción, debe liderar el equipo de recepción y asegurar el servicio al huésped. Para postulaciones envia tus antecedentes a chumanav@gmail.com o pincha en postular\r\n', 'chumanav@gmail.com', 'Hostal sector Bellavista', 'www.talenttoserve.com', 'banner/Hostel 2.jpg', '2016-10-20 00:00:00', NULL, 1),
(114, 'Ayudante de Cocina', 'Cadena de hoteles con 24 años en el mercado, requiere contratar: AYUDANTE DE COCINA. para el Área de RESTAURANT. El Objetivo del cargo se orienta a apoyar las diversas labores de la cocina, incluyendo limpieza, desinfección de equipos y utensilios, y la elaboración previa de productos. Requisitos: - Técnico de Nivel Medio en Cocina, Gastronomía o carrera afín. - 1 año de experiencia laboral anterior como Ayudante de Cocina. Contratación directa por la empresa. Para postulaciones envia tus antecedentes a personal@postulacion.cl    o pincha en postular \r\n ', 'personal@postulacion.cl', 'Hoteles Plaza el Bosque', 'http://www.plazaelbosque.cl/', 'banner/logo plaza el bosque.png', '2016-10-26 00:00:00', NULL, 1),
(115, 'Sous Chef', 'Buscamos a alguien con pasión por la cocina, que quiera vivir en contacto con la naturaleza y que tenga ganas de superarse siempre. Objetivo:Mantener y asegurar la calidad y seguridad de los productos y elaboraciones que se sirven a los huéspedes, tanto en el restaurant como en las excursiones, respetando las políticas y procedimientos de la empresa.Requisitos: Técnico o profesional en el ámbito de la Gastronomía. Idioma inglés.Experiencia: 3 años en cocina de similar nivel. Manejo de equipos de trabajo. Para postulaciones enviar antecedentes a  cv@awasi.cl indicando en asunto el cargo al que postulas o pinchar en el botón \"postular\".', 'cv@awasi.cl', 'Awasi Patagonia - Torres del Paine', 'www.awasi.com', 'banner/Awasi 2.jpg', '2016-11-02 00:00:00', NULL, 1),
(117, 'Subgerente de Hotel', 'Hotel ubicado en la ciudad de Puerto Natales, XII Región de Magallanes, requiere contratar a un/a Subgerente de Hotel.\r\nBuscamos a un profesional hotelero,  con al menos 3 años de experiencia liderando equipos de trabajo. Es imprescindible contar con habilidades blandas, vocación de servicio, siendo la cara visible del hotel.El cargo es de carácter indefinido, como Subgerente residente.El o la  profesional debe contar con un  fluido manejo de idioma inglés, tanto conversacional como escrito, para atender principalmente a huéspedes extranjeros.Enviar curriculum actualizado con expectativas salariales al email  pborges@talenttoserve.com o pincha en \" postular \"\r\n', 'pborges@talenttoserve.com', 'Hotel Puero Natales', 'www.talenttoserve.com', '', '2016-11-05 00:00:00', NULL, 1),
(118, 'F&B Supervisor', 'Estamos buscando un F&B Supervisor - Sommelier, quien coordinará y ejecutará la operación de Alimentos y Bebidas. Funciones:\r\nMonitorear y coordinar la operación del día a día de los restaurants de la propiedad y de las actividades gastronómicas outdoor, tomando las medidas necesarias para garantizar que se mantengan las normas de presentación de los productos y el servicio, Reclutar, capacitar, supervisar y guiar al personal del restaurant, Presentar, promover el vino producido en la propiedad y acompañar su servicio, Responder a las consultas de los huéspedes y organizar sus pedidos especiales, Supervisar y mantener el inventario, coordinar la compra de suministros y garantizar el\r\ncumplimiento de todas las regulaciones de alimentos y bebidas, Asistir en el desarrollo y gestión de cumplimiento de las políticas y procedimientos del\r\ndepartamento, generando productividad y garantizando el cumplimiento de los estándares de servicio de la cadena, Servir de enlace con el Chef Ejecutivo y el Gerente General en una variedad de temas relacionados con la presentación de la comida, del vino, el diseño del menú y la operación general.Requisitos:\r\nEstudios orientados Hotelería, Restauración o Sommelería. Poseer experiencia mínima de 2 años en una posición similar (Supervisor de F&B) en hoteles 5*, restaurants de categoría o cruceros, Manejo fluido del idioma inglés (Excluyente). Tercer idioma deseable, Capacidad para hacer frente eficazmente a los clientes internos, externos y el personal.Demostrar liderazgo para dirigir y entrenar a una fuerza laboral diversa,Devoción para exceder los estándares de servicio, la prestación de servicios y estándares de lamás alta calidad. Altamente organizado, capaz de priorizar las tareas múltiples, tener un sentido de urgencia para\r\ncompletar los proyectos y estar orientado al detalle. Conocimientos de informática: Manejo de MS Office y Manejo de Micros, Poseer sólidos conocimientos de Sommelier, Orientado a la Venta, Lugar de Trabajo:VI Región,Chile, alojamiento en la propiedad.Enviar antecedentes a sfiere@vik.cl o pinchar en postular.', 'sfiere@vik.com', 'Hotel Viña Vik', 'www.vik.cl', 'banner/Logo viña vik.jpg', '2016-11-07 00:00:00', NULL, 1),
(119, 'Gerente de Hotel', 'Cadena Hotelera Nacional requiere para Hotel ubicado en sector oriente de Santiago, Gerente de Hotel. El responsable del cargo deberá manejar la operación del Hotel y supervisar la operación de un restaurant y un bar. Indispensable experiencia Hotelera y manejo del idioma inglés. Interesados enviar CV y pretensiones de renta a pborges@talenttoserve.com indicando en el asunto : \"Gerente de Hotel sector oriente\" o pinchar en postular', 'pborges@talenttoserve.com', 'Cadena Hotelera Nacional', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2016-11-08 00:00:00', NULL, 1),
(120, 'Steward ( Copero )', 'The Singular Santiago, hotel ubicado a pasos del metro Universidad Católica y Bellas Artes, requiere incorporar de manera estable, personal con experiencia como Steward (Copero). Requisitos:Experiencia mínima en el cargo, Disponibilidad para trabajar en turnos rotativos (6x1) Beneficios: Colación , Uniforme, Estabilidad laboral. Favor enviar antecedentes a rrhhsantiago@thesingular.com o pinchar en postular\r\n', 'rrhhsantiago@thesingular.com', 'The Singular Santiago', '', 'banner/logo singular.jpg', '2016-11-16 00:00:00', NULL, 1),
(121, 'Garzón / Sommelier', 'Personalidad agradable y excelente actitud de servicio.Buenas Habilidades de comunicación, organización y entusiasmo. Poseer espíritu de trabajo en equipo.\r\nFlexibilidad, Unidad e Iniciativa.Experiencia en Servicio de F&B de excelencia (Experiencia en hoteles 5* / Restaurants de categoría / Cruceros). Estudios\r\nReferidos a Administración Hotelera / Restauración o Sommelería. Excelente presencia. Dominio del Idioma Inglés (Excluyente). Manejo del idioma Portugués (Preferentemente) Lugar de Trabajo: Millahue, VI Región, Chile. Posibilidad de\r\nalojamiento en la propiedad. Enviar antecedentes a sfiere@vik.cl o pinchar en postular.', 'sfiere@vik.cl', 'Hotel Viña Vik', 'www.vinavik.com', 'banner/Logo viña vik.jpg', '2016-11-21 00:00:00', NULL, 1),
(122, 'Supervisor de Front Desk', 'Amplio conocimiento de la industria hotelera nacional y conocimiento acabado de los principales destinos turísticos. Deseable estudios en: Hotelería, turismo, relaciones públicas, eco turismo. Es imprescindible un nivel de inglés avanzado, hablado y escrito, se valorará un tercer idioma. Se valorará uso avanzado de Opera.\r\nDisponibilidad para trabajar en turnos rotativos. Deseable experiencia de trabajo en turismo y hotelería en San Pedro de Atacama o Patagonia o alguna viña. (no excluyente) Colaboración a la gerencia general en la operación del hotel.  Experiencia liderando equipos. El postulante debe tener muchas ganas de incorporarse a un proyecto nuevo, hombre o mujer, chileno o extranjero. Envía tus antecedentes al siguiente correo: trabajo@ladera.cl o pincha en postular\r\n', 'trabajo@ladera.cl', 'Ladera Hotel, Providencia - Santiago', 'www.ladera.cl', 'banner/logo ladera.jpg', '2016-11-28 00:00:00', NULL, 1),
(123, 'Coordinador/a de Spa', 'The Singular Hotels requiere contratar Coordinador/a de Spa: experiencia previa en cargos similares en hotelería o centros deportivos. Manejo de idioma inglés y  de tareas administrativas. Favor enviar antecedentes a rrhhsantiago@thesingular.com o pinchar en postular. \r\n', 'rrhhsantiago@thesingular.com', 'The Singular Santiago', 'www.thesingular.com', 'banner/logo singular.jpg', '2016-11-29 00:00:00', NULL, 1),
(124, 'Bartender', 'The Singular Santiago busca incorporar Bartender.\r\nExperiencia previa en el cargo.\r\nManejo idioma inglés.\r\nDisponibilidad para trabajar en sistema de Turnos.\r\nPosibilidades de desarrollo en The Singular Hotels (empresa con hoteles en Patagonia y Santiago) Favor enviar antecedentes a rrhhsantiago@thesingular.com o pinchar en postular. ', 'rrhhsantiago@thesingular.com', 'The Singular Santiago', 'www.thesingular.com', 'banner/logo singular.jpg', '2016-11-30 00:00:00', NULL, 1),
(125, 'Jefe de Recepción', 'Buscamos Jefe de Recepción, con nivel intermedio a avanzado de inglés y disponibilidad horaria, experiencia de dos años en  recepción de hoteles de destino deseable.  Alojamiento y alimentación en la propiedad. Contrato indefinido.  Enviar antecedentes a pborges@talenttoserve.com o pinchar en postular.', 'pborges@talenttoserve.com', 'Hotel Boutique Puerto Natales', 'http://www.talenttoserve.com/index.php', 'banner/hotel tts.jpg', '2016-12-06 00:00:00', NULL, 1),
(126, 'Maestro de Cocina', 'Necesitamos Maestro de cocina para hotel boutique en Puerto Natales, estudios y experiencia acordes al puesto,  con al menos 2 años de experiencia en cocina de hoteles boutique o  restaurantes con alto nivel de calidad, en cuarto frio y pastelería.\r\nResidencia en Natales o Punta Arenas, disponibilidad inmediata, sueldo acorde a capacidad y conocimientos. Alimentación incluida y posibilidad de alojamiento a evaluar. Enviar antecedentes a pborges@talenttoserve.com o pinchar en postular.', 'pborges@talenttoserve.com', 'Hotel Boutique en Puerto Natales', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2016-12-19 00:00:00', NULL, 1),
(127, 'Encargado (a) de Compras', 'Se busca Encargado(a) de Compras, quien se encargara de realizar cotizaciones, compras, inventarios y todo lo relacionado con el área de Abastecimientos y bodegas. Tendrá que realizar los requerimientos de las diferentes áreas y cumplir con los procedimientos y procesos que la empresa establece. Requisitos: Carrera a fin, experiencia de mínimo 3 años en el rubro hotelero, Excel nivel Intermedio. Enviar antecedentes a pborges@talenttoserve.com indicando al cargo al que postula o pinchar en postular.\r\n ', 'pborges@talenttoserve.com', 'Importante Cadena de Hoteles Sector Oriente', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-01-06 00:00:00', NULL, 1),
(128, 'Recepcionistas Bilingues', 'Se busca Recepcionistas Bilingües, Recepciona y registra los datos de todos los clientes de la Empresa, carga en las cuentas los consumos y realiza los check-outs de los mismos, asegurándose que los ingresos correspondientes estén incluidos y sean pagados.  Administra Caja de Seguridad en la que se almacenan artículos de valor guardados por arrendatarios.  Atiende a los arrendatarios de la Empresa, promocionando y entregando los nuestros servicios. Requisitos: Carrera a fin, experiencia de mínimo 2 años en el rubro hotelero, Ingles Avanzado. Enviar antecedentes a pborges@talenttoserve.com indicando al cargo al que postula o pinchar en postular. \r\n ', 'pborges@talenttoserve.com', 'Importante Cadena de Hoteles Sector Oriente', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-01-06 00:00:00', NULL, 1),
(129, 'Supervisor de Alimentos y Bebidas', 'Se busca Supervisor de Alimentos y Bebidas, Supervisar todos los servicios a entregar diariamente, tales como desayunos para arrendatarios y servicios de banquetería como coffee breaks, almuerzos, etc.  Realizar turnos del personal y procesos administrativos que demande el cargo. Requisitos: Carrera a fin, experiencia de mínimo 3 años en el rubro hotelero. Enviar antecedentes a pborges@talenttoserve.com indicando al cargo al que postula o pinchar en postular. \r\n ', 'pborges@talenttoserve.com', 'Importante Cadena de Hoteles Sector Oriente', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-01-06 00:00:00', NULL, 1),
(130, 'Maestro (a) de Cocina', ' Se requiere persona responsable, puntual con alto grado de compromiso y experiencia en el puesto de Maestro(a) de Cocina, disposición para trabajar en turnos rotativos,  atención directa a los huéspedes y clientes del hotel, se ofrece sueldo acorde al mercado y  grato ambiente laboral, interesados favor enviar el CV a gcampos@lastarriahotel.com o pinchar en postular.\r\n ', 'gcampos@lastarriahotel.com', 'Lastarria Boutique Hotel', 'www.lastarriahotel.com', 'banner/Logo lastarria 2.png', '2017-01-09 00:00:00', NULL, 1),
(131, 'Camareras', 'Ladera Hotel en Providencia busca para incorporar a su equipo: Camarera de habitaciones, Buen ambiente de trabajo , disponibilidad de trabajar en turnos rotativos 6x1, Sueldo 380.000.- enviar cv a trabajo@ladera.cl  o presentar cv en Los Araucanos 2021, Providencia o pinchar en postular\r\n', 'trabajo@ladera.cl', 'Ladera Hotel, Providencia - Santiago', 'www.ladera.cl', 'banner/logo ladera.jpg', '2017-01-11 00:00:00', NULL, 1),
(132, 'Copero/ Vajillero', 'Hotel Ladera busca para incorporar copero, buen ambiente de trabajo, renta acorde al mercado, buscamos gente con muchas ganas de incorporarse a un equipo joven. Asegurar el aseo e higiene de los implementos y equipos de cocina, cumpliendo con los requerimientos del HACCP y los estándares establecidos por Gerencia. Mantener la limpieza e higiene de las Áreas de Cocina y Sala de Basura. Limpieza y aseo de horno, cocina, plancha, freidora, campana, paredes, techo, pisos, etc. Lavado de la loza y de los implementos de trabajo, interviniendo en las circunstancias que lo ameriten. Informar inmediatamente a su jefe directo sobre los problemas técnicos que presenten equipos a y/o maquinaria de cocina general.\r\nEnviar cv a trabajo@ladera.cl  o presentar cv en Los Araucanos 2021, Providencia o pinchar en postular. \r\n\r\n\r\n\r\n', 'trabajo@ladera.cl', 'Ladera Hotel, Providencia - Santiago', 'www.ladera.cl', 'banner/logo ladera.jpg', '2017-01-11 00:00:00', NULL, 1),
(133, 'Garzon/a', 'Hotel Ladera en Providencia busca garzón , hombre o mujer, chileno o extranjero, con muchas ganas de incorporarse a una empresa nueva y joven, que tengan una gran orientación al servicio y habilidades comunicacionales.\r\n\r\n\r\n- Atender los requerimientos de alimentos y bebidas de los clientes, de acuerdo a sus gustos\r\n\r\ny preferencias, mediante un servicio de calidad y de excelencia.\r\n\r\n- Servir pedidos en un tiempo preciso y sin demora.\r\n\r\n- Realizar Montaje de salón y mesas.\r\n\r\n- Retirar platos y servicios sucios, manteniendo limpios los salones.\r\n\r\n- Repasar cristalería, cuchillería y loza.\r\n\r\n- Utilizar correctamente el sistema de ventas.\r\n\r\n- Conocer la carta y la composición de cada preparación.\r\n\r\n- Conocer los distintos tipos de servicios ofrecidos e informarse del estado de reservaciones.\r\n\r\nRequisitos:\r\n\r\nIdiomas: Ingles Conversacional, experiencia demostrable.\r\n\r\nenviar cv a trabajo@ladera.cl o pinchar en postular.\r\n', 'trabajo@ladera.cl', 'Ladera Hotel, Providencia - Santiago', 'www.ladera.cl', 'banner/logo ladera.jpg', '2017-01-11 00:00:00', NULL, 1),
(134, 'Recepcionistas', 'Buscamos Recepcionista Full Time con disponibilidad inmediata. Se requiere persona dinámica para dar la bienvenida y atender a nuestros huéspedes, ofreciendo un excelente servicio de atención al cliente.\r\nLas funciones principales serán: check-in, check-out, atención e información al cliente, facturación de servicios consumidos por huéspedes y clientes. Requisitos:\r\n1 año en el cargo. Manejo de sistema hotelero Opera, Dominio de Ingles y/o Portugués, escrito y oral. Los interesados pueden postular de manera directa enviando el CV por email a: rrhh@solacehotel.cl o pinchar en postular. ', 'rrhh@solacehotel.cl', 'Hotel Solace ', '', 'banner/logo solace.jpg', '2017-01-12 00:00:00', NULL, 1),
(135, 'Administrador de Hotel y Personas', 'Buscamos Administrador que realice la labor de supervisar y velar por el buen funcionamiento de todas las instalaciones, asegurando el control, prevención y planificación ante posibles contingencias de gestión, mantenimiento y clientes.\r\n- Formación: Administración Hotelera o carrera afín\r\n- Experiencia mínima: 2 años en cargos similares\r\n- Idioma: Manejo de Inglés (hablado y escrito)\r\n- Computación: manejo excel, word y de preferencia algún sistema de reservas.\r\n- Habilidades: liderazgo, actitud de servicio, alto grado de dinamismo y proactividad.\r\n- Tipo de contrato: según artículo 22, sin horario fijo. Enviar antecedentes con pretensiones de renta y cargo de interés a postulaciones.andeshoteles@gmail.com o pinchar en postular.\r\n\r\n', 'postulaciones.andeshoteles@gmail.com', 'Hotel para IV Región, Valle del Elqui', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-01-12 00:00:00', NULL, 1),
(136, 'Administrador de Hotel y Personas', 'Buscamos Administrador que realice la labor de supervisar y velar por el buen funcionamiento de todas las instalaciones, asegurando el control, prevención y planificación ante posibles contingencias de gestión, mantenimiento y clientes. - Formación: Administración Hotelera o carrera afín - Experiencia mínima: 2 años en cargos similares - Idioma: Manejo de Inglés (hablado y escrito) - Computación: manejo excel, word y de preferencia algún sistema de reservas. - Habilidades: liderazgo, actitud de servicio, alto grado de dinamismo y proactividad. - Tipo de contrato: según artículo 22, sin horario fijo. Enviar antecedentes con pretensiones de renta y cargo de interés a postulaciones.andeshoteles@gmail.com o pinchar en postular. ', 'postulaciones.andeshoteles@gmail.com', 'Hotel para VIII Región, Valle Las Trancas', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-01-12 00:00:00', NULL, 1),
(137, 'Auxiliares de Aseo', 'Hotel ubicado en Las Condes,  busca auxiliares de aseo para realizar aseo a los departamentos y áreas comunes que se le asignen, manteniendo dichas dependencias en óptimas condiciones.Horario: Turnos rotativos de mañana y tarde.\r\nBeneficios de la empresa:\r\n•	Colación.\r\n•	Seguro Complementario.\r\n•	Convenios con Ópticas.\r\n•	Convenios Dentales.\r\n•	Convenios con Gimnasios.\r\n•	Entre Otros. Enviar antecedentes a pborges@talenttoserve.com indicando al cargo al que postula o pinchar en postular. \r\n', 'pborges@talenttoserve.com', 'Cadena de Hoteles en Las Condes', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-01-16 00:00:00', NULL, 1),
(138, 'Mucamas', 'Hotel ubicado en Las Condes busca Mucamas para realizar y coordinar todas las tareas relacionadas con el permanente y óptimo aseo, orden y funcionamiento de los departamentos y habitaciones de la organización.\r\nHorario: Turnos rotativos de mañana y tarde.\r\nBeneficios de la empresa:\r\n•	Colación.\r\n•	Seguro Complementario.\r\n•	Convenios con Ópticas.\r\n•	Convenios Dentales.\r\n•	Convenios con Gimnasios.\r\n•	Entre Otros. Enviar antecedentes a pborges@talenttoserve.com indicando al cargo al que postula o pinchar en postular. ', 'pborges@talenttoserve.com', 'Cadena de Hoteles en Las Condes', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-01-16 00:00:00', NULL, 1),
(139, 'Jefe de Alimentos y Bebidas', 'Cadena hotelera nacional del sector oriente busca incorporar a su equipo a Jefe de Alimentos y Bebidas con experiencia comprobable en el cargo. Responsable del área restaurante, bar, banquetes y eventos y del desarrollo de otras áreas de negocios. Capaz de diseñar, implementar, capacitar y controlar la experiencia de servicio de los clientes. Énfasis en control de costos, manejo de recetas, negociación y relación con proveedores. Reportando directamente a la gerencia general. Estructura de sueldo en base a un componente variable. Indicar pretensiones de renta. Enviar antecedentes a pborges@talenttoserve.com indicando al cargo al que postula o pinchar en postular. ', 'www.talenttoserve.com', 'Cadena Hotelera Nacional  en Sector Oriente', 'http://www.talenttoserve.com/index.php', 'banner/hotel tts.jpg', '2017-01-17 00:00:00', NULL, 1),
(140, 'Chef Ejecutivo', 'Buscamos Chef con experiencia y trayectoria reconocida para hacerse cargo del Restaurant, Cocina de Banquetes y Room Service de Hotel en la región de Los Lagos.\r\nFavor enviar CV y pretensiones de renta a pborges@talenttoserve.com ,  indicando el cargo al que postula o pinchar en postular. ', 'pborges@talenttoserve.com', 'Hotel de Cadena en Región de los Lagos', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-01-17 00:00:00', NULL, 1);
INSERT INTO `op_trabajo` (`codigo`, `cargo`, `descripcion`, `link`, `hotel`, `web`, `banner`, `fecha_creacion`, `fecha_actualizacion`, `estado`) VALUES
(141, 'Recepcionistas', 'Buscamos personas con experiencia en Hoteles con alta ocupación, manejo de idiomas, imprescindible inglés y conocimiento acabado del sistema OPERA (requisito excluyente).\r\nFavor enviar cv y pretensiones de renta indicando al cargo que postula a pborges@talenttoserve.com o pinchar en postular.', 'pborges@talenttoserve.com', 'Importante Hotel Sector Vitacura', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-01-17 00:00:00', NULL, 1),
(142, 'Terapeutas', 'The Singular Patagonia (hotel ubicado a 5 km de Puerto Natales) busca terapeutas con experiencia en Hoteleria, para trabajar durante la Temporada 2017-2018. Las entrevistas se realizaran en Santiago para fines de Marzo; interesadas enviar C.V. aaravena@thesingular.com o pinchar en postular.\r\n', 'aaravena@thesingular.com', 'The Singular Patagonia', 'http://www.thesingular.com/default-es.html', 'banner/logo singular patagonia.jpg', '2017-01-24 00:00:00', NULL, 1),
(143, 'Ejecutivo Cuentas Corporativas', 'Buscamos candidatos con al menos 3 años de experiencia en el cargo,  edad entre 25 y 30 idealmente , hombre o mujer . Nivel de inglés intermedio.  Envía tus antecedentes indicando al cargo que postulas a jpbeaujanot@lucianokhotel.com o pincha en postular. ', 'jpbeaujanot@lucianokhotel.com', 'Luciano K Hotel Boutique', 'www.lucianokhotel.com', 'banner/Luciano K logo(1).jpg', '2017-02-06 00:00:00', NULL, 1),
(144, 'Asistente de Supervisora Ama de Llaves', 'The Singular Santiago, hotel ubicado a pasos del metro Universidad Católica y Bellas Artes, requiere incorporar de forma estable a Asistente de Supervisora Ama de Llaves. Requisitos: - Disponibilidad a trabajar por turnos rotativos - Experiencia previa mínima de 2 años en cargos similares - Idioma inglés. Interesados enviar su CV a santiagopostulaciones@thesingular.com o pinchar en postular. ', 'santiagopostulaciones@thesingular.com', 'The Singular Santiago', 'www.thesingular.com', 'banner/logo singular.jpg', '2017-02-08 00:00:00', NULL, 1),
(145, 'Alumno en Práctica', 'Alumno(a) en Práctica \r\nCarrera de Turismo u Hoteleria.\r\nEnfoque: Preparación de Indicadores Hoteleros con el fin de definir estrategias comerciales y de marketing. Competencias: Manejo de excel básico, facilidades numéricas. Beneficios: Movilización y Colación, posibilidades de hacer tésis en el tema. Mandar antecedentes a clausalgsuazo@hotmail.com o pinchar en postular\r\n', 'clausalgsuazo@hotmail.com', 'Hotel Boutique Barrio Bella Vista', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-02-09 00:00:00', NULL, 1),
(146, 'Ejecutivo de Reservas', 'Buscamos incorporar a Ejecutivo de Reservas. Debe responder a solicitudes de reservas de personas particulares, agencias de viajes y empresas, vía email, teléfono y web. Cotizar y confirmar reservas, procesar cancelaciones y modificaciones. Requisitos: Experiencia en manejo de Opera. Idioma Inglés. Experiencia de al menos 2 años en cargo similar. Por favor enviar antecedentes a pborges@talenttoserve.com indicando el cargo al que postula o pinchar en postular.\r\n', 'pborges@talenttoserve.com', 'Hotel 5 Estrellas Santiago', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-02-13 00:00:00', NULL, 1),
(147, 'Auxiliar Ama de Llaves', 'Buscamos personas que quieran unirse a nuestro equipo de trabajo en el Hotel Holiday Inn Express Las Condes como Mucamas. Deben realizar la limpieza y preparación de las habitaciones de los huéspedes. En caso que se requiera, deberá colaborar con las funciones de limpieza del resto del Hotel. Se trabaja en turnos de 6x1, los días feriados trabajados se compensan y de los días libres en el mes dos son domingos. Garantizamos un excelente clima laboral, seguro complementario de Salud y otros beneficios. Requisitos: Tener experiencia en Aseo o en cargos operativos. Interesados enviar su Curriculum Vitae a  rafael.reyes@talbot.cl indicando el cargo al que están interesados o ir a dejarlo directamente al Hotel en Av. Vitacura 2929, Las Condes.', 'rafael.reyes@talbot.cl', 'Holiday Inn Express Las Condes', 'www.ihg.com', 'banner/Logo Holiday Inn Express.jpg', '2017-02-27 00:00:00', NULL, 1),
(148, 'Jefe de Alimentos y Bebidas', 'Liderar la gestión de las operaciones de AA&BB, asegurando la excelencia en el funcionamiento de todos los ámbitos que componen la experiencia del pasajero. Velar por la maximización de las utilidades en los ámbitos que conciernen a su área de responsabilidad, tales como la eficiencia en el abastecimiento y manejo de inventarios, control de costos y maximización de las ventas. Dominio de inglés avanzado oral y escrito. Favor enviar antecedentes indicando el cargo al que postula y pretensiones de renta a candidatosmarzo2017@gmail.com o pinchar en postular. ', 'candidatosmarzo2017@gmail.com', 'Hotel ubicado en la IX Región', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-02-27 00:00:00', NULL, 1),
(149, 'Gerente de Hotel', 'Liderar la gestión de las operaciones del hotel, asegurando la excelencia en el funcionamiento de todos los ámbitos que componen la experiencia del pasajero. Velar por la maximización de las utilidades del hotel, en los ámbitos que conciernen a su área de responsabilidad, tales como la eficiencia en el abastecimiento y manejo de inventarios, control de costos y maximización de las ventas. Dominio de  inglés avanzado oral y escrito y la experiencia en AA&BB es excluyente. Favor enviar antecedentes indicando el cargo al que postula y pretensiones de renta a candidatosmarzo2017@gmail.com o pinchar en postular.', 'candidatosmarzo2017@gmail.com', 'Hotel ubicado en la IX Región', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-02-27 00:00:00', NULL, 1),
(150, 'Recepcionistas', 'Hotel Boutique del sur de la región metropolitana, busca Recepcionista que deberá recibir a los clientes y huéspedes del Hotel adecuadamente y prestarles hasta el momento de su salida, con amabilidad y profesionalismo, toda la atención necesaria para que su estancia esté a la altura de sus expectativas. Excluyente Ingles avanzado. Deseable experiencia de 2 años. Favor enviar antecedentes a pborges@talenttoserve.com indicando el cargo al que postula o pinchar en postular.', 'pborges@talenttoserve.com', 'Hotel Boutique en  Sector sur de la RM', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-02-28 00:00:00', NULL, 1),
(151, 'Chef Ejecutivo', 'Necesitamos Chef Ejecutivo, con cinco años de experiencia mínima en el cargo, conocimientos avanzados de control de costos y gestión administrativa de cocina, habilidad para liderar un grupo de profesionales, con distribución de horarios, altas condiciones de trabajo en equipo, amplio conocimiento de productos y métodos de preparación de alimentos, tanto a la carta como en grandes cantidades.”\r\nEnviar curriculum y pretensiones de renta a : hotelcalamarrhh@gmail.com o pinchar en postular.', 'hotelcalamarrhh@gmail.com', 'Compañía Hotelera en Calama', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-03-08 00:00:00', NULL, 1),
(152, 'Auditor Nocturno', 'Buscamos asegurar la grata estadía del huésped a través del cumplimiento de los estándares de calidad y servicios. \r\nPrincipales funciones:\r\n- Recibir y hacer check in/ out  a los huéspedes.\r\n- Atender los requerimientos de los huéspedes.\r\n- Atender las llamadas telefónicas y derivar según corresponda.\r\n- Tomar reservas presenciales.\r\n- Realizar auditoria de las ventas del día.\r\nCondiciones del trabajo:\r\n- Se trabaja en base a turnos rotativos de 6 días trabajados por -uno de descanso (2 \r\nDomingos libres al mes)\r\n- Seguro complementario de salud.\r\n- Uniforme\r\n-Bono por ventas\r\n\r\nRequisitos Mínimos:\r\n- Formación técnica o universitaria Hotelera.\r\n- Experiencia previa en Hotelería, mínimo 2 años.\r\n- Manejo de Ingles Oral avanzado.\r\n- Manejo de Windows a nivel usuario\r\n- Indispensable  Manejo sistema Opera.:Enviar antecedentes a  seleccionamvl@gmail.com o pinchar en postular\r\n', 'seleccionamvl@gmail.com', 'Hotel en la V Región', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-03-10 00:00:00', NULL, 1),
(153, 'Coordinador Comercial', 'GHL Hoteles de Chile busca incorporar a su staff coordinador (a) comercial para área corporativa. Con el fin de ejecutar plan de comercialización de nuestros hoteles y realizar visitas a los posibles clientes. Experiencia mínima tres años en Hotelería y área comercial. Enviar antecedentes a:\r\nclaudia.bravo@ghlhoteles.com o pinchar en postular', 'claudia.bravo@ghlhoteles.com', 'GHL Hoteles de Chile', 'www.ghlhoteles.com', 'banner/logo GHL.jpg', '2017-03-21 00:00:00', NULL, 1),
(154, 'Jefe de Contabilidad', 'Cargo: Jefe de Contabilidad\r\n\r\n-       Contador Público o Contador Auditor\r\n\r\n-       Experiencia Hotelera en el área contable\r\n\r\n-       Manejo de Office y conocimientos de Software Contables\r\n\r\n-       Liderazgo y manejo de personal\r\n\r\n-       Proactivo\r\n\r\n\r\nEnviar CV y pretensiones de renta a: contabilidad2233@gmail.com o pinchar en postular\r\n\r\n', 'contabilidad2233@gmail.com', 'Cadena Hotelera de Providencia', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-03-23 00:00:00', NULL, 1),
(155, 'Supervisor de Aseo', 'Dirigir, coordinar, controlar y supervisar el trabajo desarrollado por el personal a su cargo en las empresas donde el empleador presta servicio de aseo. Para ello contará con un equipo de Aseadores y Mucamas. Requisitos: Experiencia en Hotelería mínima de 3 años y en cargos Similares, proactivo, responsable y con disponibilidad para trabajar en turnos rotativos. Favor enviar CV a selecoperadoraversalle@gmail.com o pinchar en postular.', 'selecoperadoraversalle@gmail.com', 'Importante Cadena de Hoteles Sector Oriente', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-04-03 00:00:00', NULL, 1),
(156, 'Ejecutiva de Ventas', 'Buscamos Ejecutiva de Ventas, La Labor consiste en comercializar todos los productos del Hotel, en el mercado (empresas, operadores de turismo, embajadas, Cámaras de Comercio) rigiéndose a los presupuestos de ventas establecidos por la empresa.\r\n \r\nRequisitos: Experiencia en Hotelería mínima de 4 años y en cargos Similares. Favor mandar CV a selecoperadoraversalle@gmail.com o pinchar en postular.\r\n ', 'selecoperadoraversalle@gmail.com', 'Importante Cadena de Hoteles Sector Oriente', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-04-03 00:00:00', NULL, 1),
(157, 'Garzón/a ', 'Buscamos garzón full time para la atención del restaurant del Hotel, se necesita experiencia en el cargo, inglés, dispuesto a trabajar en turno con  horarios rotativos, excelente disposición y que quiera formar parte de un excelente equipo de trabajo. Interesados favor enviar CV a supervisor@lastarriahotel.com o pinchar en postular. \r\n ', 'supervisor@lastarriahotel.com  ', 'Hotel Boutique Lastarria', 'http://www.lastarriahotel.com/', 'banner/Logo lastarria 2.png', '2017-04-04 00:00:00', NULL, 1),
(158, 'Jefe Tour Operaciones', 'Responsabilidad de toda la operación turística no hotelera, Centro de Nieve y Excursiones.  \r\n•	Gestionar la operación; costos, calidad y capacitación del centro de excursiones de los terceros contratados para actividades outdoor, (turismo, transporte) y cualquier actividad relacionada con el desarrollo de programas turísticos fuera de los hoteles\r\n•	Desarrollo de actividades outdoor en invierno y verano\r\n•	Administrar y coordinar la logística asociada a las excursiones\r\n•	Gestionar programas de certificación, formalización de contratos, protocolos de seguridad\r\n•	Supervisar que exista información adecuada y actualizada en los puntos relevantes para los visitantes en relación a las actividades de la reserva (la infraestructura no hotelera de la reserva).\r\n•	Desarrollo e implementación de nuevos proyectos\r\n•	Seguridad y prevención de riesgos\r\n\r\nRequisitos del cargo:\r\n•	Al menos cinco años de experiencia en operaciones turísticas o servicios turísticos\r\n•	Manejo de Office, Excel avanzado\r\n•	Inglés avanzado\r\n•	Deseable tercer idioma\r\n\r\nENVIAR CVs indicando el cargo y pretensiones de renta a:\r\n-	marcela.arancibia@expertia.cl\r\n-	expertia@expertia.cl o pinchar en postular\r\n', 'marcela.arancibia@expertia.cl', 'Reserva biológica región de Los Rios', 'http://www.expertia.cl/', 'banner/logo expertia.jpg', '2017-04-05 00:00:00', NULL, 1),
(159, 'Ayudantes de Cocina', 'Requisitos:\r\n-Formación profesional,\r\n-Experiencia en hoteles,\r\n-Disponibilidad para trabajar en turnos rotativos,\r\n-Experiencia en el cargo mínima de 1 año \r\nInteresados enviar CV indicando el cargo al que postula a csanchez@solacehotel.cl  o pinchar en postular.\r\n ', 'csanchez@solacehotel.cl', 'Hotel Solace ', 'http://www.solacehotel.cl/', 'banner/logo solace.jpg', '2017-04-05 00:00:00', NULL, 1),
(160, 'Maestros de Cocina', 'Hotel Solace \r\nRequisitos: -Formación profesional, -Experiencia en hoteles, -Disponibilidad para trabajar en turnos rotativos, -Experiencia en el cargo mínima de 2 años. Interesados enviar CV indicando el cargo al que postula a csanchez@solacehotel.cl o pinchar en postular. ', 'csanchez@solacehotel.cl', 'Hotel Solace ', 'http://www.solacehotel.cl/', 'banner/logo solace.jpg', '2017-04-05 00:00:00', NULL, 1),
(161, 'Chef de Cuisine', 'Requerimos 3 años de experiencia en cargo similar, alto dominio en control de inventarios, experiencia en técnicas Sous Vide, conocimiento en cocina mediterránea y muchas ganas de sumarse al equipo Solace. Favor enviar antecedentes indicando el cargo al que postula a rrhh@solacehotel.cl o pinchar en postular.', 'rrhh@solacehotel.cl', 'Hotel Solace ', 'http://www.solacehotel.cl/', 'banner/logo solace.jpg', '2017-04-07 00:00:00', NULL, 1),
(162, 'Revenue Coordinator', 'Importante Compañía hotelera busca incorporar a Revenue Coordinator. Debe elaborar reportes para Gerencia Comercial, configuración de sistemas de análisis de demanda, pronósticos para toma de decisiones y tomar acciones sobre diversos canales, actualizando la información en los mismos. Requisitos: Experiencia en manejo de Opera y CRM. Idioma Inglés. Experiencia de al menos 1 año en cargo similar. Favor enviar antecedentes indicando el cargo al que postula a pborges@talenttoserve.com o pinchar en postular\r\n\r\n', 'pborges@talenttoserve.com', 'Importante Compañía Hotelera', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-04-12 00:00:00', NULL, 1),
(163, 'Ayudante de Garzón', 'Requisitos: Experiencia mínima en hoteles o restaurantes de alto nivel de 2 años, inglés(no excluyente), formación de hotelería (no excluyente). Favor enviar antecedentes indicando el cargo al que postula a rrhh@solacehotel.cl  o pinchar en postular.\r\n ', 'rrhh@solacehotel.cl', 'Hotel Solace ', 'http://www.solacehotel.cl/', 'banner/logo solace.jpg', '2017-04-12 00:00:00', NULL, 1),
(164, 'Garzón/a', 'Requisitos: Experiencia mínima en hoteles o restaurantes de alto nivel de 2 años, inglés(no excluyente), formación de hotelería (no excluyente). Favor enviar antecedentes indicando el cargo al que postula a rrhh@solacehotel.cl o pinchar en postular. ', 'rrhh@solacehotel.cl', 'Hotel Solace ', 'http://www.solacehotel.cl/', 'banner/logo solace.jpg', '2017-04-12 00:00:00', NULL, 1),
(165, 'Encargado de Cobranzas', 'Se busca persona que realice todas las labores inherentes del área de Cobranza dentro del área de Administración y Finanzas del Hotel. \r\nNivel de Estudios: Técnico en Administración de Empresas, Contador, Carrera a fin.  Experiencia : Ideal 3 años en empresas Hoteleras.  Conocimiento en Plataformas y Excel Nivel Avanzado. Manejo de Softland. Por favor enviar antecedentes al  correo pondarza@solacehotel.cl o pinchar en postular.\r\n ', 'pondarza@solacehotel.cl', 'Hotel Solace ', 'http://www.solacehotel.cl/', 'banner/logo solace.jpg', '2017-04-24 00:00:00', NULL, 1),
(166, 'Chef Ejecutivo', 'Buscamos Chef Ejecutivo que se haga cargo de las cocinas del restaurant principal, bar y casino del personal. 5 años de experiencia en Hoteles de 4 y/o  5 estrellas, manejo de presupuestos, perfil organizado y creativo, diseño de cartas, liderazgo y capacidad de trabajar bajo presión. Sistema de 11 días de trabajo por 4 de descanso, vivienda y alimentación incluidas. Favor enviar antecedentes a gerentehotel@lastorres.com o pinchar en postular.', 'gerentehotel@lastorres.com', 'Hotel Las Torres, Torres del  Paine', 'www.lastorres.com', 'banner/logo las torres.jpg', '2017-04-26 00:00:00', NULL, 1),
(167, 'Terapeutas', 'The Singular Patagonia (hotel ubicado a 5km de Puerto Natales) busca terapeutas con experiencia en Hoteleria, para trabajar durante la Temporada 2017-2018. Alojamiento y alimentación incluidos.  Interesadas enviar C.V al siguiente correo:  aaravena@thesingular.com o pinchar en postular. \r\n', 'aaravena@thesingular.com', 'The Singular Patagonia', 'www.thesingular.com', 'banner/logo singular patagonia.jpg', '2017-05-03 00:00:00', NULL, 1),
(168, 'Gerente de Hotel', 'Buscamos profesional con 5 años de experiencia en Hoteles, dispuesto a vivir en la  5ª región, con conocimientos de ingles, estudios de hoteleria, y manejo de sistemas hoteleros y restaurant. Favor enviar antecedentes a hotel5taregion@gmail.com o pinchar en postular.', 'hotel5taregion@gmail.com', 'Hotel 5ta Región', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-05-05 00:00:00', NULL, 1),
(169, 'Jefe de Alimentos y Bebidas', 'Es responsable de la Administración del restaurante, bar y cocina, control y supervisión de todo el personal a su cargo, responsable del control de costos y a su vez de la imagen de los espacios físicos tanto en limpieza como mantención, se preocupa de la calidad del servicio e instruye al personal. Genera negociaciones eficientes con proveedores puntuales de su área. Por favor mandar antecedentes a jwolf@hcdl.cl o pinchar en postular.', ' jwolf@hcdl.cl', 'Hotel Cabaña del Lago Puerto Varas', 'www.hotelcabanadellago.cl', 'banner/logo hotel-cabanas-del-lago-tdl-3.jpg', '2017-05-10 00:00:00', NULL, 1),
(170, 'Recepcionista Part Time', 'Buscamos Recepcionista Part Time con disponibilidad inmediata.\r\nSe requiere persona dinámica para dar la bienvenida y atender a nuestros huéspedes, ofreciendo un excelente servicio de atención al cliente.\r\nLas funciones principales serán: check-in, check-out, atención e información al cliente, facturación de servicios consumidos por huéspedes y clientes.\r\n \r\nRequisitos:\r\n1 año en el cargo\r\nManejo de sistema hotelero Opera\r\nDominio de Ingles y/o Portugués, escrito y oral\r\nPor favor enviar antecedentes a rrhh@solacehotelcl o pinchar en postular\r\n ', 'rrhh@solacehotel.cl', 'Hotel Solace ', 'www.solacehotel.cl', 'banner/logo solace.jpg', '2017-05-16 00:00:00', NULL, 1),
(171, 'Chef Ejecutivo', 'Requisitos: Estudios: universitario o técnicos superiores. • EXPERIENCIA: mínimo 8 años como chef ejecutivo en hoteles de destinos remotos (idealmente) u hoteles de categoría CONOCIMIENTOS:Administrar el talento humano y los recursos materiales para optimizar la producción. Manejo de - Excel avanzado. - Office. - Ideal algún software hotelero/ gastronómico. (Micros). - Inglés intermedio/avanzado. - Deseable conocimiento de algún otro idioma (alemán, portugués, francés), Disponibilidad para residir en Huilo Huilo. - Licencia de conducir al día (clase B).Excelente manejo de relaciones interpersonales. - Alta orientación al servicio a personas y a los resultados operacionales solicitados. - Empatía y capacidad de negociación. - Flexibilidad. - Liderazgo. - Dinámico y enérgico. - Creativo e innovador. - Adaptabilidad  - Alta tolerancia a la frustración. - Buenas habilidades de gestión del tiempo, de resolución de problemas y toma de decisiones. - Buena capacidad de organización, dirección y control. - Orientación a la gestión de calidad y aplicación de procedimientos y estándares  • Jornada laboral: 15 x 5 o 12 x 3. - Beneficios: alojamiento para el colaborador, alimentación, uniforme, pc, teléfono con plan corporativo. Enviar CVs indicando el cargo y pretensiones de renta a:   marcela.arancibia@expertia.cl  o pinchar en postular \r\n', 'marcela.arancibia@expertia.cl', 'Hotel Reserva Biológica Huilo Huilo', 'www.expertia.cl', 'banner/logo expertia.jpg', '2017-05-25 00:00:00', NULL, 1),
(172, 'Personal para Front Desk y Conserjería', 'The Singular Patagonia (hotel ubicado a 5km de Puerto Natales) busca personal para Front Desk y Conserjería con experiencia en Hoteleria, para trabajar durante la Temporada 2017-2018. Alojamiento incluido. \r\nInteresados enviar C.V al siguiente correo:  foriolo@thesingular.com o pinchar en postular. ', 'foriolo@thesingular.com', 'The Singular Patagonia', 'www.thesingular.com', 'banner/logo singular patagonia.jpg', '2017-06-07 00:00:00', NULL, 1),
(173, 'Jefe de Alimentos y Bebidas', 'Buscamos Jefe de Alimentos y Bebidas, quien realizará las siguientes labores dentro de nuestra empresa: Planificar, coordinar y dirigir todas las actividades referentes a servicios de alimentación y Bebidas. Administrar y dirigir el personal bajo su responsabilidad, manejando indicadores de gestión que permitan trazar estrategias dirigidas al logro de la satisfacción plena de nuestros clientes. Mantener contacto directo y relaciones con los clientes e identificar posibles oportunidades de nuevos y mejores servicios para la organización.\r\n \r\nRequisitos: Carrera a fin, experiencia mínima de 5 años en cargos de dirección  de Alimentos y Bebidas. Favor enviar antecedentes indicando el cargo al que postula  a fcuevas@time.cl  o pinchar en postular', 'fcuevas@time.cl', 'Time Hotel & Apartments', 'www.time.cl', 'banner/logo time 2.png', '2017-06-09 00:00:00', NULL, 1),
(174, 'Supervisor de Alimentos y Bebidas', ' \r\nBuscamos Supervisor de Alimentos y Bebidas, quien realizará las siguientes labores dentro de nuestra empresa: Supervisar todos los servicios de desayunos, almuerzos y cena en restaurante Boki, además de todas las labores Administrativas que demande el cargo.\r\n \r\nRequisitos: Carrera a fin, experiencia mínima de 3 años en cargos similares. Experiencia en Hoteleria. Favor enviar antecedentes indicando el cargo al que postula  a fcuevas@time.cl o pinchar en postular', 'fcuevas@time.cl', 'Time Hotel & Apartments', 'www.time.cl', 'banner/logo time 2.png', '2017-06-09 00:00:00', NULL, 1),
(175, 'Supervisor de Housekeeping', 'Busca Supervisor de Housekeeping, quien realizará las siguientes labores dentro de nuestra empresa: Dirigir, coordinar, controlar y supervisar el trabajo desarrollado por el personal a su cargo en las empresas donde el empleador presta servicio de aseo (Empresas-Clientes).\r\n \r\nRequisitos: Carrera a fin, experiencia mínima de 3 años en cargos similares. Experiencia en Hoteleria. Favor enviar antecedentes indicando el cargo al que postula a fcuevas@time.cl o pinchar en postular', 'fcuevas@time.cl', 'Time Hotel & Apartments', 'www.time.cl', 'banner/logo time 2.png', '2017-06-09 00:00:00', NULL, 1),
(176, 'Personal para Pastelería', 'Buscamos incorporar a personal para Pasteleria.\r\nRequisitos:\r\n- Experiencia previa de 1 año en el cargo o similar\r\n- Disponibilidad para trabajar por turnos. Favor enviar antecedente a pborges@talenttoserve.com o pinchar en postular', 'pborges@talenttoserve.com', 'Importante Hotel ', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-06-13 00:00:00', NULL, 1),
(177, 'Botones', 'The Singular Santiago busca incorporar a botones.\r\nRequisitos:\r\n- Inglés\r\n- Disponibilidad para trabajar por turnos.\r\n\r\nEnviar CV a santiagopostulaciones@thesingular.com o pinchar en postular.', 'santiagopostulaciones@thesingular.com', 'The Singular Santiago', 'www.thesingular.com', 'banner/logo singular 2.png', '2017-06-13 00:00:00', NULL, 1),
(178, 'Auditor Nocturno', 'Ofrecemos buena remuneración, excelente ambiente de trabajo, requisitos: inglés fluido, disponibilidad en turnos rotativos, excelentes relacionadores, personas comprometidas y apasionadas por su trabajo, por favor enviar CV trabajo@ladera.cl o pinchar en postular', 'trabajo@ladera.cl', 'Ladera Hotel, Providencia - Santiago', 'www.ladera.cl', 'banner/logo ladera.jpg', '2017-06-20 00:00:00', NULL, 1),
(179, 'Ejecutivo de Reservas', 'Buscamos incorporar a Ejecutivo de Reservas. Debe responder a solicitudes de reservas de personas particulares, agencias de viajes y empresas, vía email, teléfono y web. Cotizar y confirmar reservas, procesar cancelaciones y modificaciones. Requisitos: Experiencia en manejo de Opera. Idioma Inglés. Experiencia de al menos 2 años en cargo similar. Por favor enviar antecedentes a pborges@talenttoserve.com indicando el cargo al que postula o pinchar en postular. ', 'pborges@talenttoserve.com', 'Hotel 5 Estrellas Santiago', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-06-23 00:00:00', NULL, 1),
(180, 'Botones', 'Hotel Boutique ubicado en Bellavista, se encuentra en la búsqueda de persona proactiva, que hable inglés, buena presencia, dispuesta a trabajar en turnos rotativos y formar parte de un gran equipo de trabajo. El puesto es para botones y atención al huésped, remuneración acorde al mercado. Interesados contactar al siguiente mail: gcampos@castillorojohotel.com o pinchar en postular.\r\n ', 'gcampos@castillorojohotel.com', 'Hotel Boutique Sector Bellavista', 'www.castillorojohotel.com', 'banner/logo castillo rojo.png', '2017-07-04 00:00:00', NULL, 1),
(181, 'Encargado de Cobranzas', 'Buscamos Encargado de Cobranzas para ser parte del Departamento de Administración. Esta persona se encargada de gestionar las cuentas por cobrar, contabilizar en forma diaria las transferencias y abonos a las cuentas de la empresa, envió y revisión de facturas emitidas por el Hotel. Gestionar retiros de cheques con el Estafeta y mantener un control sobre las cuentas corrientes de todos los clientes.\r\n \r\nRequisitos: Experiencia en cargos similares dentro del área de Cobranzas por 3 años, Excel Nivel Intermedio. Carreras a fin. Experiencia en Hotelería.\r\n \r\nEnviar CV a correo: selecoperadoraversalle@gmail.com o pinchar en postular.', 'selecoperadoraversalle@gmail.com', 'Importante Hotel de Santiago', 'www.talenttoserve.com', 'banner/hotel tts.jpg', '2017-07-12 00:00:00', NULL, 1),
(182, 'Jefe de Alimentos y Bebidas', 'Ejecutivo(a) con más de 10 años de experiencia en administración de restoranes.\r\nEl fuerte es la hora de almuerzo con 250 platos servidos exclusivos (no menú).\r\nEl restoran cuenta con 20 personas en la cocina y 30 garzones.\r\nLe reportan además el encargado de compras y bodega.\r\nEl horario de trabajo es de martes a domingo y fines de semana en que se realicen torneos de golf y/o otros eventos.\r\nLa persona debe tener las siguientes competencias:\r\n\r\nFuerte liderazgo\r\nConocimientos de control de costos (finanzas)\r\nCapacidad comprobada de delegar y supervisar\r\nCapacidad de trabajo bajo presión.\r\n\r\nLa renta aproximada es de $2.200.000 líquidos más bonos. Favor enviar antecedentes a:  ceciliagarciav@gmail.com\r\n', 'ceciliagarciav@gmail.com', 'Club de Golf de Santiago de Chile', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2017-07-25 00:00:00', NULL, 1),
(183, 'Maitre', 'Se requiere contratar Maitre.\r\nExperiencia previa en el cargo.\r\nManejo idioma inglés.\r\nDisponibilidad para trabajar en sistema de Turnos.\r\nPosibilidades de desarrollo en The Singular Hotels (empresa con hoteles en Patagonia y Santiago)\r\n\r\nEnviar CV a santiagopostulaciones@thesingular.com indicando el cargo al que postula o pinchar en postular\r\n', 'santiagopostulaciones@thesingular.com', 'The Singular Santiago', 'www.thesingular.com', 'banner/logo singular 2.png', '2017-07-27 00:00:00', NULL, 1),
(184, 'Encargado de Adquisiciones', 'Buscamos incorporar Encargado(a) de Adquisiciones quien será responsable de gestionar las cotizaciones, compras de insumos y Alimentos de la Empresa. Requisitos: Experiencia en Cargos Similares en Hoteleria minimo de 3 años. Conocimientos de Excel. Carrera a fin. Favor enviar antecedentes indicando el cargo al que postula a pborges@talenttoserve.com  o pinchar en postular. \r\n', 'pborges@talenttoserve.com', 'Importante Hotel de Santiago', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2017-07-28 00:00:00', NULL, 1),
(185, 'Botones Full Time', 'Se requiere personal dinámica para dar la bienvenida y atender a nuestros huéspedes, ofreciendo un excelente servicio de atención al cliente. Persona proactiva, que hable inglés, este dispuesto a trabajar en turnos rotativos y que tenga disponibilidad inmediata. Favor enviar antecedentes a mpitters@solacehotel.cl  o pinchar en postular.', 'mpitters@solacehotel.cl', 'Hotel Solace Santiago', 'www.solacehotel.cl', 'banner/logo solace.jpg', '2017-07-31 00:00:00', NULL, 1),
(186, 'Jefe de Recepción', 'Buscamos Jefe de Recepción, con experiencia de al menos 2 años en cargos de jefatura preferentemente de recepción, en hoteles boutique altamente orientados al servicio, conocimientos avanzados de inglés, sistemas de reservas en web, buen manejo de computación, habilidades blandas, capacidad de organización, buena comunicación con las personas, capacidad de supervisión de áreas de recepción y housekeeping, y alta capacidad de trabajo en equipo,  \r\nEl cargo es indefinido con inicio el 1 de septiembre, posibilidad de alojamiento a conversar.\r\nEnviar cv a contacto@weskar.cl  o pinchar en postular', 'contacto@weskar.cl', 'Hotel Weskar Puerto Natales', 'www.weskar.cl', 'banner/logo weskar.jpg', '2017-08-01 00:00:00', NULL, 1),
(187, 'Maitre', 'Busca incorporar a su equipo la posición de Maître .\r\nSe requiere persona proactiva, dispuesta a trabajar en turnos rotativos y que tenga disponibilidad inmediata.\r\nSon requisito: Hablar ingles, Tener 3 a 5 años en el mismo cargo, Manejo de personal, Conocer servicio de restaurante y evento,  Conocimiento básico de bares, Preferencia con experiencia en Hotel, Manejo básico de Micros y Opera, Manejo básico Microsoft office. Favor enviar CV indicando el cargo a gnardone@solacehotel.cl  o pinchar en postular. \r\n ', 'gnardone@solacehotel,cl', 'Hotel Solace Santiago', 'www.solacehotel.cl', 'banner/logo solace.jpg', '2017-08-01 00:00:00', NULL, 1),
