(189, 'Chef de Cuisine, Tulum, Riviera Maya, Mexico', 'Una compañía Hotelera independiente con actualmente 5 preciosos Hoteles Boutique en México y en el extranjero (con dos proyectos más en la mesa por desarrollar) está buscando un CHEF DE CUISINE de Nacionalidad Mexicana para estar a cargo del Restaurante en uno de sus Hoteles con 12 habitaciones y 2 Villas. Favor enviar antecedentes indicando el cargo al que postula a operaciones@foodforsenses.com  o pinchar en postular.', 'operaciones@foodforsenses.com', 'Food for Senses', 'www.foodforsenses.com', 'banner/logo heiner1.png', '2017-08-04 00:00:00', NULL, 1),
(190, 'Enc. Mercadotécnica, Guanacaste, Costa Rica', 'Una empresa muy establecida con varios diferentes rubros de negocios en Tamarindo, Guanacaste, Costa Rica está buscando una(o) ENCARGADA/O DE MERCADOTECNIA para promocionar local & regionalmente todos sus negocios que involucran Restaurantes, Casinos y otros servicios turísticos. Debe que ser Nacionalidad Costarricense dispuesta de reubicarse al hermoso polo turístico de Tamarindo. Favor enviar antecedentes indicando el cargo al que postula a operaciones@foodforsenses.com o pinchar en postular.\r\n\r\n\r\n', 'operaciones@foodforsenses.com', 'Food for Senses', 'www.foodforsenses.com', 'banner/logo heiner1.png', '2017-08-04 00:00:00', NULL, 1),
(191, 'Gerente de Ventas, Guanacaste, Costa Rica', 'Una empresa muy establecida con varios diferentes rubros de negocios en Tamarindo, Guanacaste, Costa Rica está buscando una(o) GERENTE DE VENTAS (cualquier nacionalidad) para uno de sus Hoteles Boutique Resort de 50 habitaciones abierto y operando.\r\nEl concepto del Hotel es Plan Europeo y ha sido especialmente diseñado para parejas y adultos que buscan un ambiente tranquilo y exclusivo. Favor enviar antecedentes indicando el cargo al que postula a operaciones@foodforsenses.com o pinchar en postular.\r\n\r\n\r\n\r\n ', 'operaciones@foodforsenses.com', 'Food for Senses', 'www.foodforsenses.com', 'banner/logo heiner1.png', '2017-08-04 00:00:00', NULL, 1),
(197, 'Chef Ejecutivo, Santiago de Chile', 'Estamos buscando a un French Chef de Cuisine listo para hacerse cargo de dos Restaurantes y Bares como CHEF  EJECUTIVO en un Hotel de Negocios de marca internacional en la Capital de Chile, Santiago de Chile. Esta sería una gran oportunidad para un joven chef francés de restaurante de entrar a una carrera de hotel de una empresa internacional muy bien establecida. Favor enviar antecedentes indicando el cargo al que postula a operaciones@foodforsenses.com o pinchar en postular. ', 'operaciones@foodforsenses.com', 'Food for Senses', 'www.foodforsenses.com', 'banner/logo heiner1.png', '2017-08-04 00:00:00', NULL, 1),
(202, 'Jefe de Guías Torres del Paine', 'Formar, coordinar y supervisar el trabajo de los guías con el fin de entregar un servicio de calidad al Huésped\r\n-Distribución de excursiones\r\n-Coordinar roles y horarios de su equipo de guías\r\n-Revisión de presupuesto del área\r\n-Guiar en Van, caminatas y caballos\r\n-Manejo de grupos\r\n-Realizar preparativos de excursiones\r\nCompetencias: \r\n-	Atención y concentración\r\n-	Expresión oral: vocabulario, dicción y tono\r\n-	Autonomía\r\n-	Orientación al cliente\r\n-	Trabajo en equipo\r\n-	Proactividad e iniciativa\r\n-	Trabajo bajo presión, organización\r\n-	Office: Nivel medio\r\nTécnico en Turismo o turismo aventura. \r\nManejo de idiomas, manejo de grupos, conocimiento de primeros auxilios\r\nInglés: Avanzado, se valorará conocimientos en otro(s) idioma(s)\r\nExperiencia mínima: 3 años ocupando cargos similares. Enviar antecedentes a subgerenterrhh@lastorres.com  o pinchar en postular\r\n', 'subgerenterrhh@lastorres.com', 'Importante Holding Hotelero', 'www.lastorres.com', 'banner/logo las torres.jpg', '2017-08-08 00:00:00', NULL, 1),
(203, 'Supervisora Ama de Llaves', 'Importante hotel ubicado a pasos del Metro Universidad Católica, requiere contratar a Supervisora Ama de Llaves.\r\nRequisitos:\r\n\r\nExperiencia previa en el cargo.\r\nManejo idioma inglés.\r\nDisponibilidad para trabajar en sistema de Turnos.\r\nEnviar CV a pborges@talenttoserve.com o pinchar en postular\r\n', 'pborges@talenttoserve.com', 'Importante Hotel de Santiago', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2017-08-11 00:00:00', NULL, 1),
