(207, 'Jefe de Bares', 'Buscamos líder para administrar el área de Bebestibles. Fuerte inclinación hacia control de costos e inventarios y manejo de personal. Estudios Técnicos de Nivel Medio o Superior en Hotelería o Mixologia. Experiencia mínima de 3 años en cargo de jefatura. Actitud de servicio y liderazgo. Disponibilidad de horarios. Visa de residencia en Chile. Dominio del inglés. Enviar CV actualizado a ybenavides@hrcsantiago.cl o pinchar en postular.\r\n', 'ybenavides@hrcsantiago.cl', 'Restaurant Internacional', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2017-08-31 00:00:00', NULL, 1),
(208, 'Jefe de Recepción', 'Corralco Resort de Montaña busca para su hotel ubicado en la Reserva Nacional Malalcahuello, IX Región,\r\nJefe de Recepción:\r\n \r\n- Experiencia previa como Jefe de Recepción o Supervisor.\r\n- Responsable y analítico\r\n- Conocimientos de hotelware es un plus\r\n- Excelente atención al cliente y vocación de servicio\r\n- Inglés, valorable un segundo idioma de preferencia portugués\r\nLos interesados deben enviar su CV indicando el cargo al que postulan en el asunto, con sus pretensiones de renta y disponibilidad a  jvila@corralco.com  o pinchar en postular.', 'jvila@corralco.com', 'Corralco Resort de Montaña', 'www.corralco.com', 'banner/logo corralco.png', '2017-09-01 00:00:00', NULL, 1),
(209, 'Chef Ejecutivo', 'Corralco Resort de Montaña busca para su hotel ubicado en la Reserva Nacional Malalcahuello, IX Región, \r\nChef Ejecutivo:\r\n \r\n-        Manejo de costos y presupuestos\r\n-        Presentación estética de los platos\r\n-        Conocimientos de pastelería y cocina\r\n-        Manipulación de alimentos al vacío\r\n-        Innovar en la cocina con productos locales\r\n-        Conocimiento de los procedimientos de manipulación de alimentos. Los interesados deben enviar su CV indicando el cargo al que postulan en el asunto, con sus pretensiones de renta y disponibilidad a jvila@corralco.com o pinchar en postular.', 'jvila@corralco.com', 'Corralco Resort de Montaña', 'www.corralco.com', 'banner/logo corralco.png', '2017-09-01 00:00:00', NULL, 1),
(210, 'Jefe de Operaciones y Servicios', 'Se busca Jefe de Operaciones y Servicios para Hotel Boutique en el sur de Santiago, excluyente experiencia en cargos similares, manejo de sistemas de gestión Hotelera e inglés avanzado, de preferencia con movilización propia, renta líquida $1.000.000.\r\nFavor mandar antecedentes indicando el cargo al que postula a  pborges@talenttoserve.com  o pinchar en postular.', 'pborges@talenttoserve.com', 'Hotel Boutique Sur de Santiago', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2017-09-05 00:00:00', NULL, 1),
(211, 'Recepcionista ', 'Buscamos recepcionista, con experiencia mínima de 1 año en hoteles o áreas de atención al cliente. Habilidades de comunicación, capacidad de trabajo en equipo y alta orientación al servicio. Conocimiento de inglés y sistema hotelero de reservas, proactividad. Interesados por favor enviar sus antecedentes a tourismadvisors2017@gmail.com  o pinchar en postular\r\n', 'tourismadvisors2017@gmail.com', 'Weskar Patagonian Lodge, Pto Natales', 'www.weskar.cl', 'banner/logo weskar transparente.png', '2017-09-05 00:00:00', NULL, 1),
(214, 'Hostess de Restaurante', 'Requisitos: Sexo femenino, excelente presentación, edad de 19 a 27 años, inglés 60%, disponibilidad para trabajar de 07:00 a 15:00 hrs.\r\nHabilidades: actitud de servicio, trabajo bajo presión, trabajo en equipo, apego a normas.\r\nActividades: atención directa con clientes, llenado de bitácora, supervisión de meseros, supervisión del montaje de menús.\r\nFavor enviar antecedentes a \r\nmayte.cecena@hotelesrealinn.com  o pinchar en postular.\r\n', 'mayte.cecena@hotelesrealinn.com', 'Hotel Real Inn Tijuana, México', 'www.hotelesrealinn.com.mx', 'banner/Logotipo RI Tijuana.jpg', '2017-09-11 00:00:00', NULL, 1),
(215, 'Recepcionista ', 'Requisitos: Sexo indistinto, excelente presentación, edad de 19 a 32 años, inglés 80%, disponibilidad para trabajar en horarios rotativos (turno de mañana, tarde y noche).\r\nHabilidades: actitud de servicio, trabajo bajo presión, trabajo en equipo, apego a normas, solución de problemas.\r\nActividades: atención directa con clientes, manejo de valores, realizar check in y check out, atención de llamadas telefónicas. Favor enviar antecedentes a mayte.cecena@hotelesrealinn.com o pinchar en postular.\r\n\r\n\r\n', 'mayte.cecena@hotelesrealinn.com', 'Hotel Real Inn Tijuana, México', 'www.hotelesrealinn.com.mx', 'banner/Logotipo RI Tijuana.jpg', '2017-09-11 00:00:00', NULL, 1),
(216, 'Jefe de Almacen', '\r\nRequisitos: Sexo masculino, edad de 24 a 40 años, disponibilidad de horarios de Lunes a Sábado, experiencia mínima 1 año en el puesto manejando alimentos y bebidas.\r\nHabilidades: actitud de servicio, trabajo bajo presión, trabajo en equipo, apego a normas.\r\nActividades: recepción de mercancía, trato directo con proveedores, captura de información, realizar inventarios, acomodo y limpieza del área.Favor enviar antecedentes a mayte.cecena@hotelesrealinn.com o pinchar en postular.\r\n\r\n\r\n', 'mayte.cecena@hotelesrealinn.com', 'Hotel Real Inn Tijuana, México', 'www.hotelesrealinn.com.mx', 'banner/Logotipo RI Tijuana.jpg', '2017-09-11 00:00:00', NULL, 1),
(217, 'Auxiliar de Almacen', 'Sexo masculino, edad de 19 A 35 años, disponibilidad de horarios de Lunes a Sábado.\r\nHabilidades: actitud de servicio, trabajo bajo presión, trabajo en equipo, apego a normas.\r\nActividades: recepción de mercancía, limpieza y acomodo de productos, realizar inventarios. Favor enviar antecedentes a mayte.cecena@hotelesrealinn.com o pinchar en postular.\r\n\r\n\r\n', 'mayte.cecena@hotelesrealinn.com', 'Hotel Real Inn Tijuana, México', 'www.hotelesrealinn.com.mx', 'banner/Logotipo RI Tijuana.jpg', '2017-09-11 00:00:00', NULL, 1),
(218, 'Patelero/ Panadero', 'Requisitos: Sexo indistinto, disponibilidad de horarios para rolar turnos, experiencia en el manejo de pan dulce y pan salado de 1 año mínimo.\r\nHabilidades: actitud de servicio, trabajo bajo presión, trabajo en equipo.\r\nActividades: elaboración de pan dulce, pan salado, postres y repostería en general para área de buffet y eventos sociales. Favor enviar antecedentes a mayte.cecena@hotelesrealinn.com o pinchar en postular.\r\n\r\n\r\n', 'mayte.cecena@hotelesrealinn.com', 'Hotel Real Inn Tijuana, México', 'www.hotelesrealinn.com.mx', 'banner/Logotipo RI Tijuana.jpg', '2017-09-11 00:00:00', NULL, 1),
(219, 'Chef de Cocina', 'Buscamos Chef de Cocina mínimo 3 años en el mismo cargo, experiencia en cocina mediterránea, con dominio de nueva tendencia de cocina, técnica en cocción sous vide. Favor enviar antecedentes a buscatalentoschile2017@gmail.com  o pinchar en postular. \r\n ', 'buscatalentoschile2017@gmail.com', 'Hotel 5 estrellas Sector Providencia', 'www.talenttoserve.com', 'banner/400dpiLogoCropped.jpg', '2017-09-15 00:00:00', NULL, 1),
(220, 'Ejecutivo de Reservas', 'Buscamos incorporar a Ejecutivo de Reservas. Debe responder a solicitudes de reservas de personas particulares, agencias de viajes y empresas, vía email, teléfono y web. Cotizar y confirmar reservas, procesar cancelaciones y modificaciones. Requisitos: Experiencia en manejo de Opera. Idioma Inglés. Experiencia de al menos 2 años en cargo similar. Favor enviar CV indicando el cargo a  pborges@talenttoserve.com o pinchar en postular.\r\n', 'pborges@talenttoserve.com', 'Hotel 5 estrellas Santiago', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2017-09-26 00:00:00', NULL, 1),
(221, 'Personal para Housekeeping', 'Hotel Boutique en Bellavista está en busca de una persona para housekeeping. Disponibilidad para trabajar en turnos, experiencia en el rubro, sueldo acorde al mercado, enviar mail con antecedentes a gcampos@castillorojohotel.com  o pinchar en postular.\r\n ', 'gcampos@castillorojohotel.com', 'Hotel Boutique en Bellavisto', 'www.castillorojohotel.com', 'banner/logo castillo rojo.png', '2017-09-27 00:00:00', NULL, 1),
(223, 'Recepcionista ', 'Hotel Solace Santiago busca Recepcionista Full Time con disponibilidad inmediata.\r\nSe requiere persona dinámica para dar la bienvenida y atender a nuestros huéspedes, ofreciendo un excelente servicio de atención al cliente.\r\nLas funciones principales serán: check-in, check-out, atención e información al cliente, facturación de servicios consumidos por huéspedes y clientes.\r\n \r\nRequisitos:\r\n1 año en el cargo\r\nManejo de sistema hotelero Opera\r\nDominio de Ingles y/o Portugués, escrito y oral. Favor mandar antecedentes a mpitters@solacehotel.cl  o pinchar en postular. ', 'mpitters@solacehotel.cl', 'Hotel Solace Santiago', 'www.solacehotel.cl', 'banner/logo solace.jpg', '2017-10-03 00:00:00', NULL, 1),
(224, 'Pool Attendant', 'Hotel The Singular Santiago, ubicado en barrio Lastarria busca Pool Attendant:  Idioma inglés excluyente. Sexo masculino. Responsable del área de la piscina, atención de huéspedes y clientes y atención de bar. Se requiere proactividad, gran sentido de responsabilidad y compromiso, trabajo en equipo y actitud de servicio. \r\nPara postulaciones, favor enviar el CV a postulaciones@thesingular.com  indicando en el asunto a que puesto se postula \"  o pinchar en postular.', 'postulaciones@thesingular.com', 'The Singular Santiago', 'www.thesingular.com', 'banner/logo singular.jpg', '2017-10-05 00:00:00', NULL, 1),
(225, 'Recepcionista ', 'Hotel The Singular Santiago, ubicado en barrio Lastarria busca Recepcionista:  Idioma inglés excluyente. Sexo masculino.  Experiencia mínima 1 año en puestos de trabajos similares. Se requiere proactividad, gran sentido de responsabilidad y compromiso, trabajo en equipo y actitud de servicio. \r\nPara postulaciones, favor enviar el CV a postulaciones@thesingular.com indicando en el asunto a que puesto se postula \" o pinchar en postular.\r\n\r\n', 'postulaciones@thesingular.com', 'The Singular Santiago', 'www.thesingular.com', 'banner/logo singular.jpg', '2017-10-05 00:00:00', NULL, 1),
(226, 'Botones', 'Hotel The Singular Santiago, ubicado en barrio Lastarria busca Botones: Idioma inglés excluyente. Sexo masculino. Se requiere proactividad, gran sentido de responsabilidad y compromiso, trabajo en equipo y actitud de servicio.\r\nPara postulaciones, favor enviar el CV a postulaciones@thesingular.com indicando en el asunto a que puesto se postula \" o pinchar en postular.\r\n\r\n', 'postulaciones@thesingular.com', 'The Singular Santiago', 'www.thesingular.com', 'banner/logo singular.jpg', '2017-10-05 00:00:00', NULL, 1),
(227, 'Garzon/a', 'Hotel The Singular Santiago, ubicado en barrio Lastarria busca Garzon/a: Idioma inglés excluyente. Experiencia mínima 1 año en puestos de trabajos similares.  Se requiere proactividad, gran sentido de responsabilidad y compromiso, trabajo en equipo y actitud de servicio.\r\nPara postulaciones, favor enviar el CV a postulaciones@thesingular.com indicando en el asunto a que puesto se postula \" o pinchar en postular.', 'postulaciones@thesingular.com', 'The Singular Santiago', 'www.thesingular.com', 'banner/logo singular.jpg', '2017-10-05 00:00:00', NULL, 1),
(228, 'Recepcionista ', 'The Singular Patagonia, ubicado en Puerto Natales, busca Recepcionista: Idioma inglés excluyente.  Experiencia mínima 1 año en puestos similares. Se requiere proactividad, gran sentido de responsabilidad y compromiso, trabajo en equipo y actitud de servicio. Puesto laboral incluye alojamiento. Favor enviar antecedentes a patagoniapostulaciones@thesingular.com indicando el cargo al que postula  o pinchar en postular. \r\n', 'patagoniapostulaciones@thesingular.com', 'The Singular Patagonia', 'www.thesingular.com', 'banner/logo singular patagonia.jpg', '2017-10-10 00:00:00', NULL, 1),
(229, 'Chef Ejecutivo', 'Corralco Resort de Montaña busca para su hotel ubicado en la Reserva Nacional Malalcahuello, IX Región, Chef Ejecutivo: - Manejo de costos y presupuestos - Presentación estética de los platos - Conocimientos de pastelería y cocina - Manipulación de alimentos al vacío - Innovar en la cocina con productos locales - Conocimiento de los procedimientos de manipulación de alimentos. Los interesados deben enviar su CV indicando el cargo al que postulan en el asunto, con sus pretensiones de renta y disponibilidad a jvila@corralco.com o pinchar en postular.\r\n\r\n', 'jvila@corralco.com', 'Corralco Resort de Montaña', 'www.corralco.com', 'banner/logo corralco.png', '2017-10-10 00:00:00', NULL, 1),
(230, 'Coordinador de Grupos', 'W Santiago busca coordinador de grupos, Experiencia mínima 1 año, Inglés, conocimientos sistema opera nivel usuario front desk y reservas. Requerimos de un profesional capaz de gestionar y coordinar la operación de los grupos en W Santiago, excelentes relaciones personales y manejo de situaciones críticas.\r\nInteresados enviar CV a velia.orozco@whotels.com , asunto: coordinador de grupos; recepción de CV hasta el día 24 de octubre 2017  o pinchar en postular', 'velia.orozco@whotels.com', 'Hotel W Santiago', 'www.wsantiagohotel.com', 'banner/Logo W.jpeg', '2017-10-11 00:00:00', NULL, 1),
(232, 'Portero/Botones', 'Hotel Boutique en Bellavista está en busca de una persona para el puesto de Portero-Botones, se requiere proactividad, gran sentido de responsabilidad y compromiso laboral, trabajo en equipo y excelente actitud de servicio,  disponibilidad para trabajar en turnos rotativos, inglés nivel alto, experiencia en Hotelería, buena presencia y dispuesto a aportar al equipo del Hotel, se ofrece remuneración es acorde al mercado. Favor, enviar CV a gcampos@castillorojohotel.com o pinchar en postular.\r\n ', 'gcampos@castillorojohotel.com', 'Hotel Boutique en Bellavista', 'www.castillorojohotel.com', 'banner/logo castillo rojo.png', '2017-10-26 00:00:00', NULL, 1);
