(233, 'Supervisor/a de Ama de Llaves', 'Dirigir, coordinar, controlar y supervisar el trabajo de aseo desarrollado por Mucamas, Aseadores y Coordinadoras a su cargo en todas las propiedades donde la empresa presta servicios. Requisitos: Experiencia en Hoteleria de minimo 3 años en el mismo cargo(Excluyente). Favor enviar correo indicando el cargo al que postula a : fcuevas@time.cl  o pinchar en postular.\r\n ', 'fcuevas@time.cl', 'Hoteles Time', 'www.time.cl', 'banner/logo time.jpg', '2017-10-30 00:00:00', NULL, 1),
