(236, 'Bartender Part Time', 'Hotel Solace Santiago, ubicado en barrio Providencia busca personal para la siguiente posición: Bartender: inglés excluyente. Experiencia mínima 3 años en puestos de trabajos similares. Se requiere proactividad, gran sentido de responsabilidad y compromiso, trabajo en equipo y actitud de servicio. Favor enviar antecedentes indicando el cargo al que postula a csanchez@solacehotel.cl  o pinchar en postular.', 'csanchez@solacehotel.cl', 'Hotel Solace Santiago', 'www.solacehotel.cl', 'banner/logo solace.jpg', '2017-11-07 00:00:00', NULL, 1),
(237, 'Ayudante de Garzon/a', 'Hotel Solace Santiago, ubicado en barrio Providencia busca Ayudante Garzona/o, Idioma inglés excluyente. Experiencia mínima 1 año en puestos de trabajos similares. Se requiere pro actividad, gran sentido de responsabilidad y compromiso, trabajo en equipo y actitud de servicio. Favor enviar antecedentes indicando el cargo al que postula a csanchez@solacehotel.cl o pinchar en postular.\r\n\r\n', 'csanchez@solacehotel.cl', 'Hotel Solace Santiago', 'www.solacehotel.cl', 'banner/logo solace.jpg', '2017-11-07 00:00:00', NULL, 1),
(238, 'Garzon/a', 'Hotel Solace Santiago, ubicado en barrio providencia busca Garzon/a: Idioma inglés excluyente. Experiencia mínima 3 año en puestos de trabajos similares. Se requiere pro actividad, gran sentido de responsabilidad y compromiso, trabajo en equipo y actitud de servicio. Favor enviar antecedentes indicando el cargo al que postula a csanchez@solacehotel.cl o pinchar en postular.\r\n ', 'csanchez@solacehotel.cl', 'Hotel Solace Santiago', 'www.solacehotel.cl', 'banner/logo solace.jpg', '2017-11-07 00:00:00', NULL, 1),
(239, 'Ayudante de Cocina', 'Hotel Solace Santiago, ubicado en barrio Providencia busca Ayudante de  Cocina, experiencia mínima 1 año en puestos de trabajos similares, conocimiento de cocina mediterránea e cocción sous vide.  Se requiere pro actividad, gran sentido de responsabilidad y compromiso, trabajo en equipo y actitud de servicio. Favor enviar antecedentes indicando el cargo al que postula a csanchez@solacehotel.cl o pinchar en postular.', 'csanchez@solacehotel.cl', 'Hotel Solace Santiago', 'www.solacehotel.cl', 'banner/logo solace.jpg', '2017-11-07 00:00:00', NULL, 1),
(240, 'Maestro de Cocina Comida de Personal', 'Hotel Solace Santiago, ubicado en barrio Providencia busca Maestro de Cocina, experiencia mínima 3 años en puestos de trabajos similares, conocimiento de cocina alimentación colectiva.  Se requiere pro actividad, gran sentido de responsabilidad y compromiso, trabajo en equipo y actitud de servicio.  Favor enviar antecedentes indicando el cargo al que postula a csanchez@solacehotel.cl o pinchar en postular.', 'csanchez@solacehotel.cl', 'Hotel Solace Santiago', 'www.solacehotel.cl', 'banner/logo solace.jpg', '2017-11-07 00:00:00', NULL, 1),
(241, 'Maestro de Cocina', 'Hotel Solace Santiago, ubicado en barrio Providencia busca Maestro de Cocina, experiencia mínima 3 años en puestos de trabajos similares, conocimiento de cocina mediterránea e cocción sous vide.  Se requiere pro actividad, gran sentido de responsabilidad y compromiso, trabajo en equipo y actitud de servicio. Favor enviar antecedentes indicando el cargo al que postula a csanchez@solacehotel.cl  o pinchar en postular.', 'csanchez@solacehotel.cl', 'Hotel Solace Santiago', 'www.solacehotel.cl', 'banner/logo solace.jpg', '2017-11-07 00:00:00', NULL, 1),
(242, 'Jefa (e) de Habitaciones – Antofagasta.', 'Líder de área que deberá velar por la calidad del servicio y el correcto funcionamiento de habitaciones, recepción y áreas públicas entre otras. Favor enviar antecedentes indicando el cargo al que postula a mgomez@hubinmobiliaria.cl  o pinchar en postular.', 'mgomez@hubinmobiliria.cl', 'Hub Aparts & Suites', 'www.hubinmobiliaria.cl', 'banner/HUBaparts&suites_alta-01.jpg', '2017-11-23 00:00:00', NULL, 1),
(243, 'Encargado de Alimentos y Bebidas –Antofagasta', 'Líder de área que será el responsable de desarrollar la entrega integral de los servicios de alimentos y bebidas del Lounge del Hotel, deberá coordinar el equipo y servicio, gestionar la administración de compras, proveedores e inventarios.Favor enviar antecedentes indicando el cargo al que postula a mgomez@hubinmobiliaria.cl o pinchar en postular.\r\n\r\n', 'mgomez@hubinmobiliria.cl', 'Hub Aparts & Suites', 'www.hubinmobiliaria.cl', 'banner/HUBaparts&suites_alta-01.jpg', '2017-11-23 00:00:00', NULL, 1),
(244, 'Agente de Ventas Corporativas – Antofagasta.', ' Profesional con excelentes relaciones interpersonales, amplia red de contactos, proactiva, perseverante, orientada a los resultados. Experiencia previa mínima 3 años en ventas corporativas con cartera de clientes Hoteleros. Favor enviar antecedentes indicando el cargo al que postula a mgomez@hubinmobiliaria.cl o pinchar en postular.\r\n\r\n', 'mgomez@hubinmobiliria.cl', 'Hub Aparts & Suites', 'www.hubinmobiliaria.cl', 'banner/HUBaparts&suites_baja-03.jpg', '2017-11-23 00:00:00', NULL, 1),
(245, 'Jefe/a de Recepción', 'Se requiere:\r\n\r\n-Experiencia previa en cargos similares.\r\n-Experiencia en liderar equipos.\r\n-Manejo de Opera.\r\n-Manejo de idioma inglés.\r\n-Proactividad, responsabilidad y compromiso.\r\n-Manejo de conflictos\r\n-Muy buenas relaciones interpersonales. Favor enviar antecedentes indicando el cargo al cuál postula a pborges@talenttoserve.com  o pinchar en postular. ', 'pborges@talenttoserve.com', 'Hotel 5 estrellas ubicado en Patagonia', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2017-11-27 00:00:00', NULL, 1),
(246, 'Mucamas', 'Time Hotel & Apartments busca incorporar a Mucamas, quienes se encargan de realizar y coordinar todas las tareas relacionadas con el permanente y óptimo aseo, orden y funcionamiento de los departamentos de todas las instalaciones donde la empresa presta servicios.\r\nBuscamos personas proactivas, con experiencia en Hotelería y Servicio. Favor enviar antecedentes indicando el cargo al que postula a  fcuevas@time.cl  o pinchar en postular.\r\n ', 'fcuevas@time.cl', 'Time Hotel & Apartments', 'www.time.cl', 'banner/logo time.jpg', '2017-11-30 00:00:00', NULL, 1),
(247, 'Aseadores', 'Time Hotel & Apartments busca incorporar a Aseadores, quienes se encargan de realizar y coordinar todas las tareas relacionadas con el permanente y óptimo aseo de las dependencias de la organización donde la empresa presta servicios.\r\nBuscamos personas proactivas, con experiencia en Hotelería y Servicio. Favor enviar antecedentes indicando el cargo al que postula a fcuevas@time.cl o pinchar en postular.\r\n ', 'fcuevas@time.cl', 'Time Hotel & Apartments', 'www.time.cl', 'banner/logo time.jpg', '2017-11-30 00:00:00', NULL, 1),
(248, 'Recepcionista', 'Hotel Barrio Bellas Artes busca persona con ingles nivel medio , hombre o mujer y con experiencia mínima de dos años en el cargo. Favor enviar antecedentes a valentina@hotelcasanoble.cl  o pinchar en postular. ', 'valentina@hotelcasanoble.cl', 'Hotel Barrio Bellas Artes', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2017-11-30 00:00:00', NULL, 1),
(249, 'Jefe de Adquisiciones', 'Requisitos: 3 años de experiencia en cargo de jefatura y 5 en el área\r\nIdealmente que haya trabajado en hoteles, casinos o restaurantes\r\nQue sepa negociar con proveedores, llevar la relación con el Chef, elaborar procesos y procedimientos.\r\nReporta al Gerente General y al Gerente de Administración y Finanzas\r\nTiene un Bodeguero a cargo.\r\nCompetencias:\r\nHabilidades de negociación\r\nBuenas relaciones interpersonales\r\nTrabajo en equipo\r\nRiguroso\r\nEl horario de trabajo es: Lu a Vi de 09:00 a 18:00 y Sáb de 09:00 a 14:00. Favor enviar antecedentes a jbellp@gmail.com  o pinchar en postular.', 'jbellp@gmail.com', 'Prestigioso grupo gastronómico en Vitacura', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2017-12-01 00:00:00', NULL, 1),
(250, 'Encargado de Bodega', 'Buscamos persona con experiencia a lo menos de 3 años en cargo similares (Hoteleria)\r\nManejo sistema inventario.\r\nPrimeros Contratos por 3 meses renovable.\r\nAdecuado manejo, almacenamiento y conservación de los alimentos, insumos y equipos proporcionados por las distintas áreas del Hotel. Favor mandar antecedentes a pauly.osses31@gmail.com  o pinchar en postular. ', 'posses@iconchile.cl', 'Importante Cadena Hotelera', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2017-12-18 00:00:00', NULL, 1),
(251, 'Chef Pastelero', 'Hotel The Singular Santiago, ubicado en Barrio Lastarria, busca Chef Pastelero:\r\n\r\n-Se requiere experiencia previa de al menos 2 años.\r\n-Liderazgo y trabajo en equipo.\r\n-Compromiso y responsabilidad.\r\n-Proactividad.\r\n-Incorporación inmediata.\r\n\r\nInteresados enviar el CV a santiagopostulaciones@thesingular.com  o pinchar en postular.\r\n', 'santiagopostulaciones@thesingular.com', 'Hotel The Singular Santiago', 'www.thesingular.cl', 'banner/logo singular.jpg', '2017-12-18 00:00:00', NULL, 1),
(252, 'Ejecutivo de Ventas Corporativas', 'Corralco Resort de Montaña busca para sede en Santiago Ejecutivo de Ventas Corporativas con formación profesional en carreras relacionadas. Conocimientos: Turismo, Hotelería, Ventas Persistente con el cliente, hacer seguimiento a las cotizaciones realizadas  Buena presencia, buena dicción , desplante y personalidad  contar con cartera de clientes  haber trabajado en rubro hotelero, con iniciativa  \r\nExperiencia: Mínimo 1-2 en cargos similares. 3 - 4 años en cargos complementarios. Cartera de clientes y base de datos. \r\nDisponibilidad para viajar.Los CV deben ser enviados con el asunto \"Postulación Ventas Corporativas\" indicando pretensiones de renta al mail cbernal@corralco.com  o pinchar en postular.\r\n\r\n ', 'cbernal@corralco.com', 'Corralco Resort de Montaña', 'www.corralco.com', 'banner/logo corralco.png', '2017-12-22 00:00:00', NULL, 1),
(253, 'Gerente Residente de Hotel', 'La función principal es planificar, gestionar y supervisar todos los aspectos financieros y operativos del Hotel, asegurando una excelente calidad en la entrega del servicio en todas las áreas de operación, procurando un buen manejo financiero y una excelencia en la calidad del servicio otorgado al cliente. Debe asegurar que las interacciones entre los huéspedes y el personal se manejen correctamente, siendo capaces de entregar una experiencia genuina y de calidad. Cualificaciones:	\r\nFormación Técnico-Profesional\r\nConocimientos: Turismo, Hotelería, Alimentos y Bebidas, Prev. Riesgos\r\nCaracterísticas Personales: Líder, persistente, promotor de excelencia \r\nExperiencia: Mínimo 2 en cargos similares. 5 - 8 años en cargos complementarios. Favor enviar antecedentes a  jvila@corralco.com o pinchar en postular.\r\n\r\n\r\n', 'jvila@corralco.com ', 'Corralco Resort de Montaña', 'www.corralco.com', 'banner/logo corralco.png', '2018-01-07 00:00:00', NULL, 1),
(254, 'Recepcionista', 'The Singular Patagonia, miembro de The Leading Hotels of the World, ubicado en Puerto Natales, busca personal para la siguiente posición:\r\n\r\nRecepcionista: \r\nIdioma inglés excluyente.  Experiencia mínima 1 año en puestos similares. Se requiere proactividad, gran sentido de responsabilidad y compromiso, trabajo en equipo y actitud de servicio. Se requiere manejo de Opera nivel intermedio.\r\nIncorporación inmediata.  Puesto laboral incluye alojamiento.  Favor enviar antecedentes a patagoniapostulaciones@thesingular.com  o pinchar en postular.\r\n', 'patagoniapostulaciones@thesingular.com', 'The Singular Patagonia', 'www.thesingular.cl', 'banner/logo singular patagonia.jpg', '2018-01-23 00:00:00', NULL, 1),
(255, 'Gerente General', 'Buscamos Gerente General con experiencia mínima de 5 años en el cargo en Chile, manejo de Opera y Micros, conocimientos comerciales requeridos. Favor enviar antecedentes a  sylviaolmedo@vtr.net o pinchar en postular. ', 'sylviaolmedo@vtr.net', 'Hotel Quinta Región Chile', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2018-01-23 00:00:00', NULL, 1),
(256, 'Chef Pastelero', '“Hotel de la zona sur de Santiago necesita contratar Chef Pastelero/a con experiencia de 2 años mínimo en el cargo en hoteles o restaurantes”\r\n\r\n \r\n\r\nEntre sus tareas estarán;\r\n\r\n \r\n\r\n•             Realizar los pedidos de los ingredientes necesarios para la elaboración de los postres.\r\n\r\n•             Conocimientos de postres a partir de masas, frutas, helados, chocolates, etc para emplatado a la carta.\r\n\r\n•             Conocer y aplica los diferentes métodos de cocción, elaboración y refrigeración de los postres.\r\n\r\n•             Decorar los postres y monta los platos.\r\n\r\n•             Mantener en perfecto estado el área de trabajo.\r\n\r\n•             Mantener la limpieza del equipo y los utensilios de repostería.\r\n\r\n•             Se encarga de conservar y almacenar productos frescos, elaborados y semielaborados.\r\n\r\n•             Conocimiento en el armado de buffet y despacho en desayunos.” Favor enviar antecedentes indicando el cargo a pborges@talenttoserve.com o pinchar en postular\r\n\r\n ', 'pborges@talenttoserve.com', 'Hotel zona Sur de Santiago', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2018-01-26 00:00:00', NULL, 1),
(257, 'Recepcionista', 'Buscamos personas con experiencia en el cargo,  vocación de servicio , manejo de sistemas hoteleros y dominio del idioma inglés intermedio. Favor enviar antecedentes indicando el cargo al que postula a dprenafeta@iconchile.com  o pinchar en postular.', 'dprenafeta@iconchile.com', 'Hotel Icon Santiago', 'www.iconchile.com', 'banner/Icon.jpg', '2018-01-26 00:00:00', NULL, 1),
