(259, 'Ejecutivo(a) de Reservas ', 'Corralco Resort de Montaña necesita para su oficina en Santiago un Ejecutivo(a) de Reservas con experiencia previa de al menos 2 años para un reemplazo de post-natal. Disponibilidad inmediata,. Interesados, enviar CV a clagos@corralco.com indicando pretensiones de renta,  o pinchar en postular.\r\n', 'clagos@corralco.com', 'Corralco Resort de Montaña', 'www.corralco.com', 'banner/logo corralco.png', '2018-02-01 00:00:00', NULL, 1),
