(261, 'Personal para Ama de Llaves', 'Hotel Boutique en Bellavista está en busca de personal para el área de Ama de Llaves, se requiere disponibilidad para trabajar en turnos rotativos, experiencia laboral comprobable y que desee ser parte de un buen equipo de trabajo, renta acorde al mercado.  Interesados enviar CV a gcampos@castillorojohotel.com  o pinchar en postular\r\n\r\n ', 'gcampos@castillorojohotel.com', 'Hotel Boutique Castillo Rojo', 'www.castillorojohotel.com', 'banner/logo castillo rojo.png', '2018-02-23 00:00:00', NULL, 1),
(262, 'Barwoman', ' \r\n\r\nHotel Doubletree by Hilton ubicado en Las Condes, se encuentra en búsqueda de Barwoman\r\n\r\nRequisitos:\r\n- Contar con experiencia de al menos 1 año en el cargo\r\n\r\n-  Turnos Rotativos\r\n- Enseñanza media completa\r\n- Pasión por la calidad y el servicio\r\n- Buenas relaciones interpersonales\r\n\r\nTe ofrecemos:\r\n- Remuneración acorde al mercado.\r\n- Colación\r\n- Seguro complementario de Salud\r\n- Seguro Complementario Dental\r\n- Reconocimientos\r\n- Beneficios Hilton.\r\n- Cercano a metro Tobalaba.\r\n\r\n¡Postula con nosotros al mail hotelhiltondt@gmail.com, indicando nombre del cargo en el Asunto  o pincha en postular.\r\n\r\n ', 'hotelhiltondt@gmail.com', 'Hotel Doubletree by Hilton', 'http://www.hiltonhotels.com/es_XM/chile/doubletree-by-hilton-hotel-santiago-vitacura/', 'banner/DoubleTree-by-Hilton-Logo.png', '2018-03-16 00:00:00', NULL, 1),
(263, 'Supervisor de Banquetes', ' Hotel Doubletree by Hilton ubicado en Las Condes, se encuentra en búsqueda de un Supervisor/a de Banquetes\r\n\r\n \r\n\r\nPrincipales Funciones:\r\n\r\n- Liderar al equipo a cargo, supervisando y manteniendo el servicio acorde a los estándares del hotel.\r\n\r\n- Mantener compromiso y motivación en el equipo.\r\n\r\n- Resolver las necesidades de los clientes.\r\n\r\n \r\n\r\nRequisitos:\r\n\r\n- Experiencia mínima de 2 años en el cargo\r\n\r\n- Capacidad de gestión\r\n\r\n \r\n\r\nSi crees tener las aptitudes, esta es tú oportunidad de enviar tu cv a hotelhiltondt@gmail.com  poniendo el cargo en el asunto del mail  o pinchar en postular.', 'hotelhiltondt@gmail.com', 'Hotel Doubletree by Hilton', 'http://www.hiltonhotels.com/es_XM/chile/doubletree-by-hilton-hotel-santiago-vitacura/', 'banner/DoubleTree-by-Hilton-Logo.png', '2018-03-16 00:00:00', NULL, 1),
(264, 'Alumnos en Práctica diferentes Áreas', 'Hotel Icon Santiago invita a postular a alumnos en práctica para sus áreas de Recepción, Alimentos y Bebidas, Ama de Llaves, Recursos Humanos y Administración y Finanzas.  Solicitamos enviar antecedentes indicando el área de práctica de interés a  dborchard@iconchile.com  o pinchar en postular.', 'dborchard@iconchile.com', 'Hotel Icon Santiago', 'www.iconchile.com', 'banner/Icon.jpg', '2018-03-26 00:00:00', NULL, 1),
(265, 'Coordinador Comercial Oficina Santiago', 'Ejecutar Plan de Mercadeo para nuestra operación del Norte desde Santiago, por medio de portafolio asignado, con el objetivo de maximizar ventas. Realizando visitas en terreno a clientes y potenciales. De segmento corporativo, para promocionar los productos de los Hoteles. Experiencia en el mismo cargo 3 años como mínimo. Favor enviar antecedentes laborales a claudia.bravo@ghlhoteles.com  o pinchar en postular.\r\n\r\n', 'claudia.bravo@ghlhoteles.com', 'GHL Hoteles de Chile', 'www.ghlhoteles.com', 'banner/GHL Hoteles (2).gif', '2018-04-02 00:00:00', NULL, 1),
(266, 'Revenue Manager', 'Time Hotel & Aparment, busca incorporar a Revenue Manager, profesional encargado de gestionar las técnicas de revenue management, que consisten en el análisis de datos para poner en marcha métodos de adaptación de tarifas a la demanda y otras estrategias del área comercial de nuestra empresa. Esta persona se encargará de liderar el Departamento de Reservas, reportando directamente al Gerente General. En Time buscamos colaboradores comprometidos, eficientes, apasionados, éticos y cálidos, cualidades que son muy importantes para nuestra empresa.\r\nRequisitos: Ingles Avanzado, Experiencia en Revenue(Excluyente), Experiencia en Hoteleria/Turismo, Carrera a fin. Favor enviar antecedentes a fcuevas@time.cl  o pinchar en postular.', 'fcuevas@time.cl', 'Time Hotel & Apartments', 'www.time.cl', 'banner/logo time.jpg', '2018-04-10 00:00:00', NULL, 1),
(267, 'Portero / Botones', 'Hotel Boutique en Bellavista está en busca de una persona para el puesto de Portero-Botones, se requiere proactividad, gran sentido de responsabilidad y compromiso laboral, trabajo en equipo y excelente actitud de servicio,  disponibilidad para trabajar en turnos rotativos, inglés nivel alto, experiencia en Hotelería, buena presencia y dispuesto a aportar al equipo del Hotel, se ofrece remuneración acorde al mercado. Favor, enviar CV a gcampos@castillorojohotel.com  o pinchar en postular.', 'gcampos@castillorojohotel.com', 'Hotel Boutique Castillo Rojo', 'www.castillorojohotel.com', 'banner/logo castillo rojo.png', '2018-04-18 00:00:00', NULL, 1),
(268, 'Subgerente de Servicios', 'Buscamos Profesional Administración Hotelera o carrera afin, como responsable de las áreas de recepción, housekeeping y servicios del hotel. Experiencia mínima de 5 años en cargos similares. Inglés avanzado oral y escrito, deseable un segundo idioma. Capacidad de liderazgo en base a habilidades blandas, orientación al cliente y proactividad. Ofrecemos posibilidades de desarrollo profesional en un grato ambiente de trabajo y contrato de trabajo permanente. Interesados enviar CV indicando pretensiones de renta, referencias y disponibilidad a admi@weskar.cl  o pinchar en postular. ', 'admi@weskar.cl', 'Weskar Patagonian Lodge', 'www.weskar.cl', 'banner/logo weskar transparente.png', '2018-04-18 00:00:00', NULL, 1),
(269, 'Jefe de Operaciones', 'Jefe de Operaciones para Hotel 5 estrellas de 30 habitaciones, a cargo de la recepción, habitaciones, áreas comunes y mantenciones del Hotel.  Lidera una Dotación de 20 personas. A cargo de las compras del Hotel y de la relación con los proveedores de servicios e informática. Reporta directamente a la Gerencia General. Experiencia 5 años comprobables. Requisito definir pretensiones de renta líquida. Enviar su CV a reclutamientotts@hotmail.com  o pinchar en postular.', 'reclutamientotts@hotmail.com', 'Hotel 5 estrellas de 30 habitaciones', 'www.talenttoserve,com', 'banner/400dpiLogo.jpg', '2018-04-19 00:00:00', NULL, 1),
(271, 'Capitán de Alimentos y Bebidas', 'Time Hotel & Apartments, busca incorporar al equipo de Alimentos y Bebidas a una persona proactiva, responsable, ética y con experiencia en Servicio para desempeñarse en el cargo de Capitán de Garzones reportando directamente a la Gerencia de Alimentos y Bebidas.\r\n\r\nEntre las principales labores que realizará: Coordina directa y diariamente las funciones y tareas que cumplir el equipo de garzones para el desarrollo de los distintos servicios, tales como desayunos, almuerzos para huéspedes y arrendatarios y servicios de banquetería que nuestra empresa proporciona. Requisitos: Experiencia mínima de 2 años en cargos o labores similares. Estudios Técnicos/Universitarios en carreras de área de Turismo y Hotelería, Buena disposición y Orientación al Servicio, Disponibilidad para trabajar por turnos rotativos, ingles intermedio. Favor enviar antecedentes indicando el cargo al que postula a fcuevas@time.cl o pinchar en postular.', 'fcuevas@time.cl', 'Time Hotel & Apartments', 'www.time.cl', 'banner/logo time 2.png', '2018-05-03 00:00:00', NULL, 1),
(272, 'Ejecutivo/a de Ventas', 'Buscamos candidato con Título Técnico en Administración de empresas, Turismo o a fines, 2 años de experiencia en el rubro hotelero, Técnicas en Ventas. - Dominio del Idioma Ingles. - Microsoft Office nivel medio. - Excelentes habilidades comunicacionales, interpersonales y comerciales. Interesados favor enviar antecedentes indicando al cargo que postula a dborchard@iconchile.com  o pinchar en postular. \r\n \r\n ', 'dborchard@iconchile.com', 'Icon Hotel Santiago', 'www.iconchile.com', 'banner/Icon.jpg', '2018-05-03 00:00:00', NULL, 1),
(273, 'Chief Steward', 'Persona responsable que tenga experiencia en manejo de equipos Steward en hoteles de 4 estrellas o superior y conocimientos en manipulación de químicos y equipamiento hotelero. Debe organizar los materiales utilizados en la operación de AAyBB  y controlar mermas mediante instrumentos administrativos.Debe tener conocimiento  en confección de horarios y leyes labores básicas de una operación hotelera, orientación al trabajo en equipo. Persona mayor de 30 años con madurez para guiar y dar instrucciones tanto para su equipo de planta como colaboradores part time externos. Favor enviar antecedentes indicando el cargo al que postula a dborchard@iconchile.com  o pinchar en postular.', 'dborchard@iconchile.com', 'Icon Hotel Santiago', 'www.iconchile.com', 'banner/Icon.jpg', '2018-05-03 00:00:00', NULL, 1),
(274, 'Auditor de Ingresos y Costos', 'Time Hotel & Apartments, busca incorporar a Auditor de Ingresos y Costos para ser parte del área de Administración y Finanzas. Resumen del Cargo: Contribuir al control de la operación del negocio a través de la recopilación de información, revisión y análisis de registros, asegurando el total de los ingresos de manera exacta y confiable. Generando informes para las diferentes áreas, reportando diferencias y apoyando en todas las labores que demande el cargo reportando directamente al Gerente de Administración y Finanzas. Nuestra empresa posee 29 años de trayectoria en el rubro, buscamos colaboradores Comprometidos, Eficientes, Apasionados, éticos y Cálidos que busquen ser un aporte en nuestra empresa. Requisitos Excluyentes: Estudios Técnicos/Universitarios en Administración de empresas/Contabilidad/Hoteleria, Experiencia mínima de 3 años en cargos o labores similares dentro del Rubro de la Hoteleria, Nivel de Excel Avanzado. Favor enviar antecedentes a fcuevas@time.cl o pinchar en postular.', 'fcuevas@time.cl', 'Time Hotel & Apartments', 'www.time.cl', 'banner/logo time 2.png', '2018-06-12 00:00:00', NULL, 1),
(275, 'Recepcionistas', 'Time Hotel & Apartments, busca incorporar a Recepcionistas para ser parte del área de Operaciones. Resumen del Cargo: Recepciona y registra los datos de todos los clientes, carga en las cuentas los consumos y realiza los check-outs de los mismos, asegurándose que los ingresos correspondientes estén incluidos y sean pagados.  Atiende al Huésped y clientes de la Empresa, promocionando y entregando los nuestros servicios, Reporta directamente al Encargado de Recepción y al Gerente de Operaciones. Nuestra empresa posee 29 años de trayectoria en el rubro, buscamos colaboradores Comprometidos, Eficientes, Apasionados, éticos y Cálidos que busquen ser un aporte en nuestra empresa. Requisitos Excluyentes: Estudios Técnicos/Universitarios en carreras a fin, Experiencia mínima de 3 años en cargos o labores similares dentro del Rubro de la Hoteleria, Disponibilidad para trabajar por Turnos Rotativos, Buena disposición y orientación al Servicio, Nivel de Inglés Avanzado oral y escrito.Favor enviar antecedentes a fcuevas@time.cl o pinchar en postular.', 'fcuevas@time.cl', 'Time Hotel & Apartments', 'www.time.cl', 'banner/logo time 2.png', '2018-06-12 00:00:00', NULL, 1),
(276, 'Supervisor de Housekeeping', 'Time Hotel & Apartments, busca incorporar a Supervisor(a) de Housekeeping para ser parte del área de Operaciones. Resumen del Cargo: Dirigir, coordinar, controlar y supervisar el trabajo desarrollado por el personal a su cargo en las propiedades donde el empleador presta sus servicios.  Nuestra empresa posee 29 años de trayectoria en el rubro, buscamos colaboradores Comprometidos, Eficientes, Apasionados, éticos y Cálidos que busquen ser un aporte en nuestra empresa. Requisitos Excluyentes: Experiencia mínima de 2 años en cargos o labores similares. Estudios Técnicos/Universitarios en carreras de área de Turismo y Hotelería, Disponibilidad para trabajar por turnos rotativos, Buena disposición y Orientación al Servicio, ingles intermedio. Favor enviar antecedentes a fcuevas@time.cl o pinchar en postular.', 'fcuevas@time.cl', 'Time Hotel & Apartments', 'www.time.cl', 'banner/logo time 2.png', '2018-06-12 00:00:00', NULL, 1),
(277, 'Gerente de Ventas Chile', 'Multinacional con próximas aperturas en Chile requiere para su equipo de trabajo Gerente Corporativo de Ventas con el objetivo de dirigir el equipo comercial, generando estrategias y planes de acción que lleven a la unidad al cumplimiento del presupuesto de ingresos, a su fortalecimiento y al reconocimiento de los Hoteles en el mercado. Profesional en Carreras administrativas, ingenierías y/o carreras afines. Deseable posgrado en marketing o ventas, Bilingüe (Inglés), con conocimientos en PMS Opera, Indicadores de Gestión y Marketing y ventas.  Estratega, líder, innovador, orientado al cumplimiento de indicadores y proactivo.\r\nExperiencia mínima de 3 años en el cargo. Interesado favor enviar CV al correo aquiroga@metro-op.com  o pinchar en postular.', 'aquiroga@metro-op.com', 'Metro Hotels - Oficina Corporativa ', '', 'banner/Metro.jpg', '2018-07-03 00:00:00', NULL, 1),
(278, 'Administrador de Hotel', 'Se busca candidato con 5 años de experiencia en el cargo, conocimiento del idioma inglés, empático, proactivo . Favor mandar antecedentes a jeanpierre@behotels.cl o pinchar en postular.', 'jeanpierre@behotels.com', 'Hotel en San Pedro de Atacama', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2018-07-17 00:00:00', NULL, 1),
(279, 'Recepcionistas', 'Hotel Solace Santiago busca incorporar a su equipo Recepcionista Full Time\r\nRequisitos:\r\nPersona proactiva, responsable, Buen manejo de relaciones interpersonales\r\nExperiencia en atención al publico\r\nIdioma portugués y/o inglés avanzado excluyente\r\nExperiencia en sistema OPERA deseable.\r\nDebe contar con disponibilidad para trabajar en turnos rotativos. Interesados favor enviar CV a  rrhh@solacehotel.cl  o pinchar en postular.\r\n', 'rrhh@solacehotel.cl', 'Hotel Solace Santiago', 'www.solacehotel.cl', 'banner/logo solace.jpg', '2018-08-07 00:00:00', NULL, 1),
(280, 'Recepcionistas', 'The Singular Patagonia busca Recepcionistas. Requisitos:\r\n\r\n -Experiencia previa mínimo 2 año en cargos de atención al cliente.\r\n- Inglés avanzando excluyente.\r\n-Manejo de Opera excluyente.\r\n-Se requiere gran sentido de responsabilidad, compromiso y trabajo en equipo. \r\n -Turnos rotativos.  \r\n-Régimen 6x1\r\n-Se otorga alojamiento en casa de personal. \r\n\r\nLos interesados pueden enviar su CV a patagoniapostulaciones@thesingular.com, indicando en el Asunto el cargo al que postulan  o pinchar en postular\r\n', 'patagoniapostulaciones@thesingular.com', 'The Singular Patagonia', 'www.thesingular.com', 'banner/logo singular patagonia.jpg', '2018-08-20 00:00:00', NULL, 1),
(281, 'Cocinero/ Patelero', 'Experiencia de 4 años mínimo en el cargo en hoteles o restaurantes”\r\nResponsabilidades:\r\nRealizar los pedidos de los ingredientes necesarios para la elaboración de los postres y platos en general. Conocimientos en pastelería y cuarto frio a partir de masas, frutas, helados, chocolates, ensaladas y platos en general. Conocer y aplica los diferentes métodos de cocción, elaboración y refrigeración de los postres.Decorar los postres y montaje de platos.Mantener en perfecto estado el área de trabajo.Mantener la limpieza del equipo y los utensilios de repostería. Se encarga de conservar y almacenar productos frescos, elaborados y semielaborados. Conocimiento en el armado de buffet y despacho en desayunos. Buena tolerancia al trabajo bajo presión. Interesados enviar CV a pborges@talenttoserve.com o pinchar en postular. \r\n\r\n \r\n\r\n ', 'pborges@talenttoserve.com', 'Hotel Zona Sur Santiago', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2018-10-01 00:00:00', NULL, 1),
(282, 'Garzón', 'Hotel de la zona sur de Santiago necesita contratar garzón ( conocimiento del idioma ingles ) con experiencia de 4 años en el cargo en hoteles o restaurantes de alta gama”\r\n\r\n \r\n\r\nEntre sus tareas están:\r\n\r\n \r\n\r\n•             Realiza toma de pedidos a los huéspedes.\r\n\r\n·          Realiza servicio de room service.\r\n\r\n•             Conocimiento en servicio protocolar.\r\n\r\n•             Mantener en perfecto estado el área de trabajo.\r\n\r\n•             Conocimiento en montaje buffet.\r\n\r\nBuena tolerancia al trabajo bajo presión. Favor enviar CV indicando el cargo al que postula a pborges@talenttoserve.com  o pinchar en postular.\r\n ', 'pborges@talenttoserve.com', 'Hotel Zona Sur Santiago', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2018-10-08 00:00:00', NULL, 1),
(283, 'Jefe de Reservas', 'Cadena Hotelera busca Jefe de Reservas para que se haga cargo de la gestión de la central de reservas.\r\n\r\nIndispensable manejo de Opera y manejo de idioma inglés. Portugués deseable.\r\n\r\nExperiencia previa demostrada en el cargo. Enviar CV con pretensiones de renta a pborges@talenttoserve.com  indicando el cargo al que postula o pinchar en postular..', 'pborges@talenttoserve.com', 'Cadena Hotelera', 'www.talenttoserve.com', 'banner/logo.png', '2018-11-05 00:00:00', NULL, 1),
(284, 'Recepcionista', 'Experiencia en el area de Recepciòn.\r\n\r\nObjetivo del Cargo: Asistir a los clientes en la recepción proporcionando un servicio de calidad, de una manera eficiente, cortés y profesional. Siguiendo los estándares de hospitalidad y adhiriéndose a los lineamientos y procedimientos, internos.\r\n\r\n \r\n\r\nDominio del Ingles  nivel avanzado.\r\n\r\nDisponibilidad para trabajar turnos rotativos.\r\n\r\nManejo de Opera.\r\n\r\n \r\n\r\nFavor enviar CV indicando al cargo que postula a seleccion@renaissancehotels.cl  o pinchar en postular. ', 'seleccion@renaissancehotels.cl', 'Hotel 5 estrellas Zona Oriente Santiago', 'http://renaissance-hotels.marriott.com/es/renaissance-santiago-chile', 'banner/logo 2.png', '2018-11-05 00:00:00', NULL, 1),
(285, 'Jefe de Bares', 'Minimo 2 años de Experiencia en el ares de Alimentos y Bebidas especificamente conocimiento en el manejo de Bares.\r\n\r\nDominio del Ingles nivel medio.\r\n\r\nConocimiento de barras internacionales.\r\n\r\nCoctelera destilado\r\n\r\nManejo de ineventario\r\n\r\nManejo de personal.\r\n\r\n Favor enviar CV indicando al cargo que postula a seleccion@renaissancehotels.cl o pinchar en postular.', 'seleccion@renaissancehotels.cl', 'Hotel 5 estrellas Zona Oriente Santiago', 'http://renaissance-hotels.marriott.com/es/renaissance-santiago-chile', 'banner/logo 2.png', '2018-11-05 00:00:00', NULL, 1),
(286, 'Ejecutiva Comercial', 'Minino 2 años de experiencia en el area de Ventas.\r\n\r\nDominio Avanzado Idioma Ingles.\r\n\r\n \r\n\r\nObjetivo del cargo: Representar al hotel en el desarrollo de segmentos de mercado y nuevas relaciones con los clientes mientras mantiene relaciones existentes con cuentas asignadas en donde, constantemente, se esfuerza por maximizar los ingresos en habitaciones, salones, centros de consumo, alimentos y bebidas y demás servicios prestados por el hotel.\r\n\r\nFunciones Principales:\r\nConocer todas las características de los servicios del hotel.\r\nIdentificar cuentas potenciales.\r\nNegociar las tarifas corporativas con clientes.\r\nParticipar en las negociaciones con cuentas globales (RFPs)\r\nContactar a todas las personas que en una empresa están involucradas en la negociación, aprobación y reservación de servicios de hotel.\r\nEntender y cumplir los procedimientos de negociación de las empresas.\r\nCrear y mantener la base de datos de clientes.\r\nCrear y mantener el reporte de visitas a clientes mediante las Activities en Opera Sales and Catering. Favor enviar CV indicando al cargo que postula a seleccion@renaissancehotels.cl o pinchar en postular.', 'seleccion@renaissancehotels.cl', 'Hotel 5 estrellas Zona Oriente Santiago', 'www.talenttoserve.com', 'banner/logo 2.png', '2018-11-05 00:00:00', NULL, 1),
(287, 'Guardias de Seguridad', '\r\nBuscamos personas proactivas, dispuestas a trabajar en sistema de turnos, con curso OS10 al día, experiencia e ingles Básico, Favor enviar CV indicando al cargo que postula a seleccion@renaissancehotels.cl o pinchar en postular.', 'seleccion@renaissancehotels.cl', 'Hotel 5 estrellas Zona Oriente Santiago', 'www.talenttoserve.com', 'banner/logo 2.png', '2018-11-15 00:00:00', NULL, 1),
(288, 'Encargada/o de Spa', 'Buscamos personas con experiencia previa en cargos de supervisión en el área,\r\nIdeal experiencia en el rubro de la hotelería y servicios,\r\nIdioma ingles avanzado, \r\nDisponibilidad para trabajar en turnos rotativos,\r\nPersona orientada a las ventas y buen servicio. Favor enviar CV indicando al cargo que postula a seleccion@renaissancehotels.cl o pinchar en postular.', 'seleccion@renaissancehotels.cl', 'Hotel 5 estrellas Zona Oriente Santiago', 'www.talenttoserve.com', 'banner/logo 2.png', '2018-11-15 00:00:00', NULL, 1),
(289, 'Supervisor de Spa', 'Corralco Resort de Montaña busca\r\nSupervisora de SPA\r\nPerfil del cargo: 2 años de experiencia en posiciones similares. Conocimientos de yoga y disposición para realizar talleres. Conocimiento en piscinas. Motivación por el área comercial y el cumplimiento de metas económicas. Detallista. valorable, portugués e inglés básico.\r\nFavor enviar CV a ddapena@corralco.com o pinchar en postular. \r\n', 'ddapena@corralco.com', 'Corralco Resort de Montaña', 'https://corralco.com/', 'banner/logo corralco 2.png', '2018-12-20 00:00:00', NULL, 1),
(290, 'Cargos varios para Apertura Hotelera', 'Para la apertura de nuevo hotel en Santiago, empresa contrata profesionales de las áreas de cocina, restaurante, recepción, seguridad, limpieza, mucamas y técnicos de mantenimiento., Interesados, enviar CVs señalando en el asunto al cargo que postula a: reclutamientohotelenchile@gmail.com  o pinchar en postular.', 'reclutamientohotelenchile@gmail.com', 'Nuevo Hotel Santiago de Chile', 'www.talenttoserve.com', 'banner/400dpiLogo.png', '2019-01-11 00:00:00', NULL, 1),
(291, 'Jefe Senior Operaciones AA&BB', 'Consultora MVL, busca para   importante Empresa Multinacional dedicada al rubro de la  Hotelería y sus  sus nuevos proyectos en la V región:\r\n- Ingeniero o Administrador del ámbito Hotelero o Restoración, idealmente con experiencia en Hoteles de 4 estrellas.\r\n- Mínimo  4 años de experiencia liderando diversos equipos de trabajo .\r\n- Manejo de sistemas de gestión que le permitan una clara orientación a los resultados.\r\n- Deseable manejo de Ingles\r\n- Contrato de trabajo bajo articulo 22.\r\nEnviar cvs indicando sus pretensiones de renta y si cuenta con disponibilidad de traslado a la V Región a seleccionamvl@gmail.com  o pinchar en postular,\r\n', 'seleccionamvl@gmail.com', 'Consultora MVL', 'www.mvlconsultoria', 'banner/servicios-de-rrhh--D31679481BF54A85172414thumbnail.jpeg', '2019-01-15 00:00:00', NULL, 1),
(292, 'Gerente de Ventas', 'Buscamos persona con Experiencia comprobada de tres años en el cargo de gerente de ventas en Hotelería, Cartera de clientes mercado local y regional, Conocimiento macro de la región, Dominio de sistema CMNET y CRM, Castellano fluido, e inglés avanzado, y disponibilidad para viajar. Interesados enviar CV, indicando en el asunto al cargo que postula, a reclutamientohotelenchile@gmail.com  o pinchar en postular. ', 'reclutamientohotelenchile@gmail.com', 'Nuevo Hotel Santiago de Chile', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2019-01-29 00:00:00', NULL, 1),
(293, 'Recepcionista', 'Hotel Boutique del sur de la región metropolitana, busca Recepcionista que deberá recibir a los clientes y huéspedes del Hotel adecuadamente y prestarles hasta el momento de su salida, con amabilidad y profesionalismo, toda la atención necesaria para que su estancia esté a la altura de sus expectativas. Excluyente Ingles avanzado. Deseable experiencia de 2 años.Disponibilidad inmediata Favor enviar antecedentes a pborges@talenttoserve.com indicando el cargo al que postula o pinchar en postular.\r\n\r\n', 'pborges@talenttoserve,com', 'Hotel Boutique del Sur de la RM', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2019-02-05 00:00:00', NULL, 1),
(294, 'Chef Ejecutivo', 'Buscamos personas con gran experiencia comprobable en manejo de cocinas de Hoteles, personal a cargo, planificación, producción, despacho, catering, costos, compras, y todas las tareas que este puesto solicita. Debe estar habituado a cocinar a un público de alto nivel y exigencias, y contar con conocimientos en texturas, aromas, nuevas técnicas e innovación. Que posea vocación de servicio, iniciativa y creatividad.\r\nRequisitos excluyentes:\r\nResidencia en San Carlos de Bariloche o posibilidad de radicarse de manera permanente\r\nExperiencia de 3 años en puestos similares\r\nReferencias comprobables\r\nIdioma Inglés. Favor enviar CV al correo aaybb@villahuinid.com.ar', 'aaybb@villahuinid.com.ar', 'Hotel Villa Huinid Bariloche', 'www.villahuinid.com.ar', 'banner/Bariloche.png', '2019-02-11 00:00:00', NULL, 1),
(295, 'Guest Relations', ' You should be an excellent communicator who can stay positive when facing difficult situations. You should also be reliable and customer-oriented, as you’ll serve as a primary point of contact for our guests.\r\n\r\n \r\n\r\nMain Responsibilities:\r\n\r\nReview pre-arrival lists to welcome guests and post departure.\r\nAttend to special guests (e.g. VIPs) and answer their inquiries\r\nHelp prepare welcome folders\r\nProvide information about amenities, area and venues and promote services\r\nAnticipate guest needs and build rapport with customers\r\nOffer assistance with certain tasks (e.g. confirming travel arrangements, taking messages)\r\nCRM Software knowledge \r\nRecord information in the logbook daily\r\nEnsure compliance with health and quality standards\r\n \r\n\r\nRequirements:\r\n\r\nProven experience as a Guest Relations Associate \r\nFamiliarity with hospitality industry standards\r\nProficiency in English; knowledge of additional languages is a plus.\r\nA customer-oriented and professional attitude. Please send your CV to gcanales@castillorojohotel.com  or use the \" postular \" bottom.\r\n ', 'gcanales@castillorojohotel.com', 'Hotel Boutique Santiago', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2019-02-27 00:00:00', NULL, 1),
(296, 'Marketing Associate ', 'Marketing Associate responsibilities include assisting in organizing campaigns and developing marketing strategies.\r\n\r\nThis work will be a critical factor for the smooth operation of the Hotel and the attainment of its goals, as well as for the long-term growth of the company.\r\n\r\n \r\n\r\nMain Responsibilities:\r\n\r\nExcellent knowledge of MS Office, marketing computer software, online applications (CRM tools, Online analytics, Google Adwords), SSMM, product marketing, photoshop, web design marketing strategies, marketing software\r\n \r\n\r\nRequirements:\r\n\r\n•             Effective written and verbal communication skills in English.\r\n\r\n•             A high level of attention to detail.\r\n\r\n•             Ability to work effectively within a team and independently.\r\n\r\n•             Competency in Microsoft applications including Word, Excel, and Outlook.\r\n\r\n•             Good organization skills.\r\n\r\n•             Digital marketing experience.\r\nPlease send your CV to gcanales@castillorojohotel.com or use the \" postular \" bottom.\r\n\r\n', 'gcanales@castillorojohotel.com', 'Hotel Boutique Santiago', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2019-02-27 00:00:00', NULL, 1),
(297, 'Guest Service', 'Buscamos a una persona responsable de la atención a las necesidades de nuestros huéspedes. Trabaja en turnos 6•1\r\nRequisitos:  Experiencia de al menos 3 años en servicio al cliente \r\nEstudios a fines\r\nManejo inglés nivel conversación. Interesados favor mandar CV indicando el cargo al que postula  al correo maite_macaya@yahoo.com o pinchar en postular. ', 'maite_macaya@yahoo.com', 'Cadena Hotelera Internacional', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2019-02-28 00:00:00', NULL, 1),
(298, 'Recepcionistas', 'Buscamos a candidatos con el siguiente Perfil profesional:\r\n•	Formación específica en gestión de alojamientos turísticos.\r\n•	Dominio de Ingles.\r\n•	Una imagen cuidada.\r\n•	Excelentes habilidades de comunicación verbal, escrita y telefónica.\r\n•	Habilidades de servicio al cliente, paciencia y tacto.\r\n•	Ser una persona tranquila y organizada, incluso cuando se trabaja bajo presión.\r\n•	Habilidades en algún PMS, dado que las reservas de hotel y los sistemas de facturación se controlan a través de un software.\r\n•	La capacidad de manejar dinero en efectivo, tarjetas de crédito/débito y moneda extranjera.\r\n•	Conocimientos administrativos y habilidades de mecanografía\r\n•	Capacidad de hacer funcionar equipamiento de oficina, fotocopiadoras, sistemas de cámaras, etc.\r\n•	Conocimientos básicos de ventas y comercial.\r\n\r\nInteresados enviar antecedentes a gcanales@castillorojohotel.com o pinchar en postular. ', 'gcanales@castillorojohotel.com', 'Hotel Boutique Santiago', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2019-03-12 00:00:00', NULL, 1),
(299, 'Ejecutivo de Ventas', 'Hotel Icon Santiago busca a una persona con Adaptabilidad, Integridad., Orientación al Servicio, Orientación al Cliente, Trabajo en Equipo, Planificación y Organización, Orientación a Resultados e Iniciativa. Deberá tener Título Técnico en Administración de\r\nempresas, Turismo o a fines, 2 años de experiencia en el rubro hotelero, Técnicas en Ventas, Dominio del Idioma Ingles. Microsoft Office nivel medio y Excelentes habilidades comunicacionales, interpersonales y comerciales. Interesados enviar CV a posses@iconchile.com  indicando el cargo al que postula o pinchar en postular. \r\n', 'posses@iconchile.com', 'Hotel Icon Santiago', 'www.iconchile.com', 'banner/Icon.jpg', '2019-03-14 00:00:00', NULL, 1),
(300, 'Ama de Llaves', 'Time Hotel and Apartments necesita incorporar al equipo del área de operaciones a candidata/o cuya  labor principal consiste en gestionar, supervisar y asegurar el correcto mantenimiento y limpieza de las\r\nhabitaciones/departamentos y áreas comunes para que se encuentren perfectamente limpias y en buen\r\nestado. Cumpliendo con todos los procedimientos y estándares que la empresa establezca para todas las\r\npropiedades y el confort de nuestros huéspedes y clientes. Se requiere Nivel de Estudios: Universitarios/Técnicos, Experiencia en Hotelería, en el cargo o puestos similaras (Excluyente), Manejo de Office (Excel, Word ,Correo Electrónico), dominio de inglés.  Interesados enviar antecedentes a spacheco@time.cl  o pinchar en postular', 'spacheco@time.cl', 'Time Hotel & Apartments', 'www.time.cl', 'banner/logo time.jpg', '2019-04-10 00:00:00', NULL, 1),
(301, ' Recepcionista - Auditor Nocturno', 'COMPETENCIAS DEL CARGO:\r\n-	Planificación y organización\r\n-	Orientación al logro\r\n-	Rigurosidad y disciplina\r\n-	Manejo de conflictos\r\n-	Trabajo en equipo\r\n-	Respeto por normas y valores de la empresa REQUISITOS DEL CARGO:\r\n-	Experiencia en atención al cliente\r\n-	Inglés intermedio hablado\r\n-	Extranjero con permiso de trabajo vigente\r\n-	Experiencia en manejo Transbank\r\nInteresados favor enviar antecedentes a  gbravo@hotelsantalucia.cl con copia a fastoreca@hotelsantalucia.cl  o pinchar en postular.', 'gbravo@hotelsantalucia.cl', 'Compañía Hotelera Andes', 'www.talenttoserve.com', 'banner/logo santa lucia.jpg', '2019-04-17 00:00:00', NULL, 1),
(302, 'Servicio al Personal', 'Importante empresa Hotelera, requiere contratar a persona para “Bienestar y Servicios” , el cual será responsable de controlar, supervisar y asegurar el cumplimiento de todas las normativas legales y procedimientos internos, en lo relacionado al correcto pago de las remuneraciones y administración de personal (contratos, horas extras, finiquitos, cumplimiento de la ley laboral, documentación laboral), manteniendo siempre al día la información del personal, para no fallar en el proceso de pago de remuneraciones oportunamente.Requisitos:Tener conocimientos y experiencia de al menos 5 años, en leyes laborales y previsionales avanzado, calculo de remuneraciones, horas extras, finiquitos, vacaciones\r\nEdad, entre 30 y 45 años\r\nHabilidad en manejo y solución de conflictos, Empático, Excel Intermedio Avanzado\r\nProfesional Titulado de Ingeniería en RRHH, Tecnología en Administración de RR.HH., Administración de Empresas o carrera afín. Interesados favor enviar antecedentes a jlolave@parkplaza.cl  o pinchar en postular', 'jlovave@parkplaza.cl', 'Importante Empresa Hotelera', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2019-04-17 00:00:00', NULL, 1);
