(303, 'GERENTE RESIDENTE', ' \r\nEl responsable del cargo deberá supervisar, dirigir, controlar, administrar y rentabilizar\r\nla operación general del hotel para lograr los objetivos planeados.\r\nDebe velar por mantener y mejorar continuamente los estándares de la compañía con\r\nrespecto a los productos y servicios ofrecidos.\r\nEs responsable de la elaboración, administración y control del presupuesto anual del\r\nHotel.\r\nDebe hacerse cargo de las relaciones públicas con clientes y contactos con la\r\ncomunidad.\r\nCompetencias\r\nAlta orientación y servicio al huésped\r\nAlta capacidad de liderazgo, para trabajar con los jefes de departamentos y mantener\r\nun equipo cohesionado.\r\nCapacidad de resolución y toma de decisiones.\r\nComunicación asertiva.\r\nCapacidad para trabajar colaborativamente.\r\nExperiencia\r\nAl menos 5 años en el cargo de Gerente de Hotel.\r\nConocimientos Indispensables (ambos excluyentes)\r\nManejo avanzado de idioma inglés.\r\nManejo sistema Opera.Interesados enviar CV con pretensiones de renta a  pborges@talenttoserve.com  ', 'pborges@talenttoserve.com', 'HOTEL EN SAN PEDRO DE ATACAMA', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2019-05-13 00:00:00', NULL, 1),
(304, 'Ayudante de Cocina', 'Hotel Cumbres Lastarria busca Ayudante de Cocina, con estudios superiores en gastronomía. Sueldo liquido de $450.000.- turnos rotativos, Hotel cuenta con casino de personal.  interesados enviar cv con asunto al cargo que postula a  jvaldebenito@hotelescumbres.cl o pinchar en postular.', 'jvaldebenito@hotelescumbres.cl', 'Hotel Cumbres Lastarria', 'www.cumbreslastarria.com', 'banner/Logo Cumbres Lastarria.png', '2019-05-24 00:00:00', NULL, 1),
(305, 'Técnico en Mantención', 'Hotel Cumbres Lastarria busca Técnico en Mantención.  con conocimientos en gasfitería y electricidad. Sueldo liquido $513.000.- turnos rotativos, Hotel cuenta con casino de personal. interesados enviar cv con asunto al cargo que postula jvaldebenito@hotelescumbres.cl o pinchar en postular.', 'jvaldebenito@hotelescumbres.cl', 'Hotel Cumbres Lastarria', 'www.cumbreslastarria.com', 'banner/Logo Cumbres Lastarria.png', '2019-05-24 00:00:00', NULL, 1),
(306, 'Gerente de Hotel y Enoturismo', 'Hotel Boutique de Alta Gama, ubicado en el Valle de Colchagua, VI Región de Chile, se encuentra en la búsqueda de Gerente de Hotel y Enoturismo con base en Santiago. Buscamos alguien con fuerte foco comercial.Su principal responsabilidad será: Administrar la gestión del hotel velando por la satisfacción de huéspedes, así como del equipo y del directorio. Administrar y supervisar todas las áreas del hotel para lograr los objetivos de presupuestos, gestión y servicios, asegurando el cumplimiento de estándares de calidad esperados. Requisitos:\r\n·         Experiencia comprobable de al menos 3 años en cargos similares.\r\n\r\n·         Título profesional de Licenciado en Turismo, Hotelería o carrera afín.\r\n\r\n·         Idioma inglés nivel avanzado oral y escrito.\r\n\r\n·         Conocimiento en control de costos, gestión y presupuestos.\r\n\r\n·         Manejo de sistema Hotelero.\r\n\r\n·         Conocimiento de Revenue Management.\r\n\r\n·         Conocimiento de Marketing Digital.\r\n\r\n·         Contactos con el Canal de Distribución Tradicional y Digital.\r\n\r\n·         Experiencia en liderar equipos.\r\n\r\n·         Líder dinámico y proactivo.\r\n\r\n·         Enfoque en el Huésped de Alta Gama y altos estándares de servicio y hospitalidad.\r\n\r\n·         Alto sentido de responsabilidad y compromiso.\r\n\r\n·         Flexibilidad horaria.\r\n\r\n·         Deseable: Experiencia en Vinos y/o Enoturismo.\r\n\r\n·         Deseable: Auto propio.\r\n\r\n \r\n\r\n \r\n\r\nLugar de trabajo: Santiago, Chile. Disponibilidad para viajar a Colchagua según sea necesario y al exterior. Para postulaciones, por favor enviar su CV a postulaciones@behotels.cl , indicando en el asunto el puesto al que se postula  o pinchar en postular. \r\n\r\n ', 'postulaciones@behotels.cl', 'Hotel Boutique de Alta Gama', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2019-05-28 00:00:00', NULL, 1),
(307, 'Ejecutivo de Ventas Corporativas ', 'El responsable del cargo deberá comercializar habitaciones y eventos de la cartera asignada, buscando nuevos clientes y negocios en terreno.\r\n\r\nDeberá realizar cotizaciones, administrar sistema, gestionar formas de pago, administrar contratos de licitaciones de habitaciones y realizar seguimiento a requerimientos de clientes con el fin de cerrar las ventas.\r\n\r\nIndispensable conocimientos y manejo de sistema Opera.Favor enviar antecedentes indicando el cargo al que postula a pborges@talenttoserve.com  o pinchar en postular.\r\n\r\n ', 'pborges@talenttoserve.com', 'Cadena Hotelera', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2019-06-05 00:00:00', NULL, 1),
(308, 'Coordinador Comercial Of. Santiago', 'Descripción del cargo: Ejecutar el plan de comercialización del hotel por medio de su portafolio para maximizar ventas, así mismo debe realizar visitas a los posibles clientes para ofrecer los productos del hotel y para promocionar a las empresas y clientes, paquetes especiales organizados por la Gerencia de Mercadeo.Realizar y reportar logros en las investigaciones de mercado que se realicen con la finalidad de conocer mercado y la competencia. Mantener contacto telefónico permanente con los clientes potenciales con el fin de suplir sus necesidades e intereses. Realizar informes mensuales con indicadores de gestión, visitas y productividad de su portafolio para medir la gestión realizada durante el mes. Segmentar y clasificar el portafolio de ventas con el fin de lograr una mayor eficiencia. Interesados enviar CV indicando el cargo al que postula a marcelo.toledo@ghlhoteles.com  o pinchar en postular. \r\n ', 'marcelo.toledo@ghlhoteles.com', 'GHL HOTELES CHILE', 'www.ghlhoteles.com', 'banner/Logo GHL Hotlees 2018 P&M.png', '2019-06-19 00:00:00', NULL, 1),
