(315, 'Anfitrión', 'Se busca Anfitrión para Hotel Boutique en zona sur de la Región Metropolitana. El Anfitrión deberá asesorar y acompañar en todo momento de la estadía a los huéspedes y clientes del Hotel, entregándoles información relevante, conociendo sus intereses, interactuando y generando relaciones con ellos. Excluyente dominio de idioma inglés fluido y conocimiento en vinos. Por favor enviar CV indicando al cargo que postula y con pretensiones de renta a pborges@talenttoserve.com  o pinchar en postular.', 'pborges@talenttoserve.com', 'Hotel Boutique Zona Sur Región Metropolitana', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2019-08-06 00:00:00', NULL, 1),
(316, 'Recepcionista 20 Horas', 'Time Hotel & Apartments se encuentra en búsqueda de Recepcionista 20 Horas. Funciones principales: Proveer un servicio personalizado de recepción, bienvenida, check in, check out a lo largo de las estadías.\r\nTomar correctamente reservas.\r\n\r\nMantener actualizados los perfiles de huéspedes, y sus cuentas.\r\n\r\nFacturar y cobrar.\r\n\r\nAportar información a nuestros huéspedes respecto a lugares de interés, atracciones locales, recomendaciones, etc.\r\n\r\nActuar con profesionalismo y responsabilidad para atender sugerencias, reclamos o felicitaciones, con el correcto seguimiento que necesite cada caso.\r\n\r\nIndispensable vocación de servicio, pasión por la hotelería y turismo y deseos de superación.\r\n\r\n \r\n\r\nJornada laboral: 20 horas.  Viernes, Sábado y Domingo.\r\n\r\nAños de Experiencia      +2\r\n\r\nConocimientos deseables en:   Hotelería / sistemas CM / Ópera / Inglés intermedio excluyente / otros idiomas valorables. Interesados enviar CV indicando el cargo al que postula a  pcornejo@time.cl  o pinchar en postular. ', 'pcornejo@time.cl', 'Time Hotel & Apartments', 'www.time.cl', 'banner/logo time.jpg', '2019-08-08 00:00:00', NULL, 1),
(317, 'Recepcionista Senior', 'Time Hotel & Apartments se encuentra en búsqueda de Recepcionista Senior. Funciones principales: Proveer un servicio personalizado de recepción, bienvenida, check in, check out a lo largo de las estadías.\r\n\r\nTomar correctamente reservas.\r\n\r\nMantener actualizados los perfiles de huéspedes, y sus cuentas.\r\n\r\nFacturar y cobrar.\r\n\r\nAportar información a nuestros huéspedes respecto a lugares de interés, atracciones locales, recomendaciones, etc.\r\n\r\nActuar con profesionalismo y responsabilidad para atender sugerencias, reclamos o felicitaciones, con el correcto seguimiento que necesite cada caso.\r\n\r\nIndispensable vocación de servicio, pasión por la hotelería y turismo y deseos de superación.\r\n\r\nSupervisar, controlar y corregir los procedimientos y tareas de Recepción en general, asegurando óptimo desempeño y proveyendo de capacitación e inducción en cada caso.\r\n\r\n \r\n\r\nAños de Experiencia      +5\r\n\r\n\r\nConocimientos deseables en:   Hotelería / sistemas CM / Ópera deseable / Inglés intermedio excluyente / otros idiomas valorables. Interesados enviar CV indicando el cargo al que postula a  pcornejo@time.cl  o pinchar en postular.', 'pcornejo@time.cl', 'Time Hotel & Apartments', 'www.time.cl', 'banner/logo time.jpg', '2019-08-08 00:00:00', NULL, 1),
(318, 'Ejecutivo Comercial Tour & Travel/KAM', 'Cadena Hotelera Sector Oriente se encuentra en búsqueda de Ejecutivos Comerciales Tour&Travel/KAM. Funciones principales: Manejar y hace producir la cartera de clientes asignada por la empresa entre Operadores y Agencias de Viajes\r\nRealizar trabajos de venta y mantención de cliente en terreno y supervisar gestión de Ejecutiva T&T Junior.\r\nCaptar nuevos clientes,\r\nRealizar visitas de inspección con clientes en las diferentes propiedades\r\nCrear y mantener archivo de clientes, con todos los antecedentes de la empresa.\r\nRealizar proceso de Solicitud de Crédito de clientes\r\nAsistir a las reuniones de coordinación de ventas \r\nParticipar en los eventos organizados por la empresa\r\nNegociar condiciones tarifarias, \r\nPedir autorizaciones pertinentes al Gerente Comercial para realizar ventas especiales.\r\nAtender clientes directos, preparar cotizaciones y efectuar seguimientos.\r\nCumplir metas de Ventas \r\nRealizar gerencias de turno\r\n\r\nRequisitos:\r\nFormación Profesional Técnico/Universitario\r\nCursos de Especialización Deseable Técnicas de Ventas\r\nExperiencia 3 años en cargo similar. Interesado enviar CV indicando el cargo al que postula a paulinaacr@gmail.com  o pinchar en postular.\r\n\r\n \r\n\r\n', 'paulinaacr@gmail.com', 'Cadena Hotelera Sector Oriente', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2019-08-08 00:00:00', NULL, 1),
