(321, 'Jefe de Mantención', 'Prestigioso Hotel Zona Sur de Chile buscar incorporar a su equipo Jefe de Mantención. Descripción:\r\nDirigir el funcionamiento del departamento de mantención. Conservar y reparar máquinas, maquinaria e instalaciones, equipos e infraestructura, para conseguir óptimos resultados en los servicios brindados por la empresa y sus correspondientes áreas de negocio. Interesados mandar antecedentes indicando el cargo al que postula a  pborges@talenttoserve.com  o pinchar en postular. ', 'pborges@talenttoserve.com', 'Prestigioso Hotel Zona Sur Chile', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2019-08-27 00:00:00', NULL, 1),
