(325, 'Jefe de Spa', 'Hotel Corralco busca Jefe de Spa que tendrá la función de dirigir la operación del departamento de SPA. Responsable del correcto funcionamiento\r\nde piscina interior (climatizada y fría), jacuzzi interior, saunas, camarines, gimnasio, salas de terapia, tienda y de todos los sectores que tengan relación con el bienestar que propone nuestro SPA.  Competencias asociadas: Educación Kinesiología / Masoterapia, Formación Administración de empresas o similar, conocimientos en administración / inglés, Habilidades Toma de decisiones, planificación, administración de recursos, liderazgo, manejo de información. Experiencia 3 años en cargo similar. Favor enviar antecedentes indicando el cargo al que postula y pretensiones de renta a ddapena@corralco.com   o pinchar en postular.', 'ddapena@corralco.com', 'Hotel Corralco', 'www.corralco.com', 'banner/logo corralco 2.png', '2019-09-11 00:00:00', NULL, 1),
