(333, 'Recepcionista / Garzón / Mucama', 'Hotel Manquehue Rancagua busca contratar:  - Mucama: Full time, con experiencia en hotelería\r\n\r\n-Recepcionista Bilingue: Full y Part Time, con experiencia en rubro hotelero, software Opera Oracle y nivel medio de idioma inglés, oral y escrito\r\n\r\n-Garzón: Part time con experiencia en servicio de restauración. Favor enviar antecedentes indicando en el asunto el cargo al que postula a supervisorrecepcion@manquehuehoteles.cl  o pinchar en postular.', 'supervisorrecepcion@manquehuehoteles.cl', 'Hotel Manquehue Rancagua', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2019-11-14 00:00:00', NULL, 1),
(334, 'Auditor Nocturno', 'Hotel Casa Real de Viña Santa Rita busca Auditor Nocturno. Deseablemente de la zona o transporte propio. Ingles avanzado excluyente. Interesados enviar CV a dvalenzuela@santarita.cl  o pinchar en postular.', 'dvalenzuela@santarita.cl ', 'Hotel Casa Real de Viña Santa Rita', 'www.santarita.com', 'banner/Logo dorado en baja.png', '2019-11-22 00:00:00', NULL, 1),
(335, 'Recepcionista', 'Hotel Boutique en Santiago busca contratar recepcionistas para diferentes turnos con experiencia en el rubro hotelero y nivel de inglés avanzado. Para postular enviar antecedentes a pborges@talenttoserve.com colocando en asunto el cargo al que postula, o pinchar en postular.', 'pborges@talenttoserve.com', 'Hotel Boutique Santiago', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2019-12-04 00:00:00', NULL, 1),
(336, 'Revenue Associate', 'Hotel Boutique en Santiago busca incorporar Revenue Associate a su equipo con experiencia comprobable en revenue e inglés avanzado. Para postular enviar antecedentes a pborges@talenttoserve.com colocando en asunto el cargo al que postula, o pinchar en postular.', 'pborges@talenttoserve.com', 'Hotel Boutique Santiago', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2019-12-04 00:00:00', NULL, 1),
(337, 'Guest Relations Manager', 'Debe poder comunicarse en inglés, lectura + escritura.\r\n- Requisitos: Mínimo 2 años de experiencia en relaciones con los huéspedes.\r\nLas responsabilidades incluyen, pero no se limitan a\r\ngarantizar y proporcionar experiencias de servicio al huésped impecables, exclusivas, profesionales y de clase alta, analizando los comentarios de los clientes y brindando dirección estratégica para mejorar continuamente la calificación general\r\nrespondiendo a las necesidades de los huéspedes y anticipándose a las no especificadas. Interesados mandar CV indicando en el asunto el cargo al que postula a pborges@talenttoserve.com  o pinchar en postular. ', 'pborges@talenttoserve.com', 'Hotel Boutique Santiago', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2019-12-13 00:00:00', NULL, 1),
(338, 'Front Service Supervisor', 'Hotel Boutique en Santiago busca Front Service Supervisor. Responsabilidades: Capacitación, horarios y supervisión de recepcionista y botones, solución de problemas de huéspedes, resolución de crisis, servicio al cliente / invitado, supervisión de áreas de huéspedes. Inglés avanzado. Interesados mandar CV indicando en el asunto el cargo al que postula a pborges@talenttoserve.com o pinchar en postular.', 'pborges@talenttoserve.com', 'Hotel Boutique Santiago', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2019-12-16 00:00:00', NULL, 1),
(339, 'Assistant Revenue Manager ', 'Hotel en Santiago busca incorporar a Assistant Revenue Manager \r\nFunciones y Responsabilidades:\r\n\r\nAsegurar que la asignación de inventario y los parámetros de fijación de precios estén posicionados para respaldar los objetivos generales de ingresos del hotel.\r\n\r\nMaximizar la contribución de los ingresos netos de la habitación a través de una comprensión exhaustiva de todos los canales de reserva y la gestión del inventario y la tasa en ellos.\r\n\r\nRealización de auditorías periódicas de PM, GRC, GDS\r\nMonitoreo y ejecución de estrategias de tarifas utilizando herramientas de gestión de inventario CRS, PM, etc.\r\n\r\nTrabajar con el Equipo de Administración de Ingresos para determinar paquetes de ofertas y promociones efectivas y atractivas.\r\n\r\nApoya la estrategia de venta de hoteles en todos los sistemas de distribución.\r\n\r\nSeguimiento de precios competitivos de conjuntos y estrategias de rendimiento\r\n\r\nPreparación de materiales para las reuniones semanales de gestión de ingresos.\r\n\r\nPreparación de resúmenes de ingresos oportunos.\r\n\r\n\r\nRegistro, mantenimiento y análisis de datos actuales, históricos y estadísticos.\r\nParticipando en los procesos de planificación del presupuesto del hotel, marketing y planes estratégicos. Interesados enviar CV a pborges@talenttoserve.com o pinchar en postular.', 'pborges@talenttoserve.com', 'Hotel en Santiago', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2020-01-30 00:00:00', NULL, 1),
(340, 'Ejecutivos de Venta', 'Exclusivo Club Familiar & Golf , ubicado en sector oriente de Santiago, busca Ejecutivos de Venta para la captación de nuevos socios.\r\nRequisitos: Perfil comercial y servicio al cliente con experiencia de al menos 5 años, que cuente con cartera de clientes activa y comprobable. Debe poseer vehículo propio y disponibilidad para trabajar fines de semana (excluyente). Manejo de idiomas será un plus. Interesados enviar antecedentes a pborges@talenttoserve.com  indicando en asunto el cargo al que postula. o pinchar en postular.\r\n\r\n ', 'pborges@talenttoserve.com', 'Exclusivo Club Familiar & Golf sector Oriente', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2020-02-06 00:00:00', NULL, 1),
(342, 'Recepcionista Nocturno', 'Hotel en Santiago Categoría Upscale busca incorporar a Recepcionista Nocturno. Check in y check out de los huéspedes del hotel según sea necesario, así como ayudar con las solicitudes de los huéspedes en relación con el equipaje / maletero\r\n- Responsable del mantenimiento de las áreas del hotel, incluidos, entre otros, el vestíbulo, la oficina administrativa y el piso del salón.\r\n- Responsabilidad de auditoria nocturna.\r\n- Responsable de llevar a cabo otras tareas según lo indique el gerente según la lista de verificación nocturna.\r\n- Responsabilidad por la entrada principal del hotel y garantizar que sea segura en todo momento.\r\n- Tener una comprensión completa de los procedimientos de incendio de los hoteles para garantizar la seguridad de todo el personal y los huéspedes en todo momento. Interesados Favor enviar antecedentes a pborges@talenttoserve.com indicando en asunto el cargo al que postula o pinchar en postular.', 'pborges@talenttoserve.com', 'Hotel en Santiago Categoría Upscale', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2020-02-11 00:00:00', NULL, 1),
(343, 'Recepcionistas/ Botones', 'Hotel en Santiago Categoría Upscale busca incorporar recepcionistas y botones con experiencia en el rubro hotelero y nivel de inglés avanzado. Para postular enviar antecedentes a pborges@talenttoserve.com colocando en asunto el cargo al que postula, o pinchar en postular.', 'pborges@talenttoserve.com', 'Hotel en Santiago Categoría Upscale ', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2020-02-11 00:00:00', NULL, 1),
(344, 'Recepcionistas', 'Hotel en Santiago busca incorporar a Recepcionistas. Requisitos: Experiencia previa en el rubro hotelero y nivel de inglés avanzado. Para postular enviar antecedentes a pborges@talenttoserve.com colocando en asunto el cargo al que postula, o pinchar en postular', 'pborges@talenttoserve.com', 'Hotel en Santiago ', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2020-03-13 00:00:00', NULL, 1),
(345, 'Supervisor de Recepción', 'Hotel en Santiago busca incorporar a Supervisor/a de Recepción. Requisitos: Experiencia previa en el rubro hotelero, deberá estar a cargo de toda la operación del área y su personal respectivo. Nivel de inglés avanzado. Para postular enviar antecedentes a pborges@talenttoserve.com colocando en asunto el cargo al que postula, o pinchar en postular.\r\n\r\n', 'pborges@talenttoserve.com', 'Hotel en Santiago', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2020-03-13 00:00:00', NULL, 1),
(346, 'Auxiliar de Cocina', 'Geotel Calama busca incorporar a Auxiliar de Cocina con dinamismo y energía, que trabaje en equipo, compromiso, vocación de servicio, tolerancia para trabajar bajo presión.   Tener iniciativa, preocupación por el orden y la calidad, con buena comunicación , orientada al logro, que se adapte y sea flexible.  Con interés de aprender y crecer.  Funciones del cargo:Alistar todos los ingredientes para las preparaciones de sopas arroces, verduras ensaladas y jugos con el fin de cubrir las necesidades del día y/o alistar todos los ingredientes para las preparaciones frías o calientes.Tener la capacidad de estar a cargo de la preparación del desayuno. Recoger la requisición del almacén y organizar la mercancía en sus respectivos lugares de manera que se pueda contar con fácil acceso a los ingredientes. Conocer los equipos , saber utilizarlos y mantenerlos aseados para conservarlos en buen estado y acordes a los estándares de calidad. Acudir al Chef o al Primero o Segundo  de Cocina para que le asignen sus tareas durante el día con el fin de cumplir a cabalidad las funciones requeridas en el día. Supervisar que los puestos de trabajo permanezcan aseados y organizados con el fin de mantener un ambiente óptimo y de calidad para realizar todo lo pertinente a la preparación de alimentos. El trabajo es con turnos partidos o a requerimiento de la operación. Requerimientos: Nivel de estudios, Medio. Con experiencia comprobables y referencias ( Ideal experiencia en cocina de hoteles) Excelente Presentación Personal. Sin tatuajes en lugares visibles. Sin piercings. Adicionales: Trabajo en la ciudad de Calama. Se ofrece trabajo estable , empresa seria, pago sin retrasos crecimiento profesional, pasaje de Ida a la ciudad en avión. Auxilio de vivienda .Remuneración de acuerdo al mercado. Mínimo tres meses de prueba. Interesados favor enviar antecedentes indicando el cargo al que postula  a talentohumano.calama@geotel.cl', 'talentohumano.calama@geotel.cl', 'Geotel Calama', 'www.geotelcalama.com', 'banner/Geotel.jpg', '2020-09-28 00:00:00', NULL, 1),
(347, 'Encargado de Servicio en Restaurante', 'Geotel Calama busca incorporar a Encargado de Servicio en Restaurant con dinamismo y energía, trabaje en equipo con compromiso, vocación de servicio, tolerancia para trabajar bajo presión.  Que lidere con el ejemplo. Tener iniciativa, preocupación por el orden y la calidad, con buena comunicación , orientada al logro, que se adapte y sea flexible. Funciones del cargo: Verificar que los diferentes servicios y productos de alimentos y bebidas se estén ejecutando con los estándares requeridos en calidad y tiempo, para garantizar la satisfacción de los requerimientos del Huésped o cliente. Coordinar con la Gerencia General o la Jefatura de Alimentos y Bebidas si corresponde y su equipo de trabajo, los diferentes servicios de acuerdo a las necesidades del hotel en cuanto a ocupación y venta, con el fin de garantizar el adecuado desarrollo de los mismos. Aprender y estudiar la estructura  organizacional del Hotel, procedimientos, servicios y estándares; en especial los del área de A&B con el propósito de cumplir con el normal desarrollo de las funciones. \r\nIncluye la gestión o supervisión de la asignación de turnos de trabajo del personal a cargo, conservando los estándares de nómina. Controlar y enseñar al personal bajo su mando , protocolos y procedimientos para el normal desarrollo de la operación. Realizar la gestión de control de gastos del área, de acuerdo al presupuesto, de manera que se cumpla con las metas asignadas, optimizando los recursos financieros.Realizar los check list de los diferentes servicios para poder tomar decisiones oportunas de mejoramiento.Trabajar en armonía con el Chef y la cocina, ya que una área depende de la otra. Si la situación lo amerita colaborar en la operación. El trabajo es con turnos partidos. Requerimientos: Nivel de estudios, Medio. Excelente Presentación Personal, sin tatuajes en lugares visibles, sin piercings\r\nCon experiencia comprobables y referencias Adicionales: Trabajo en la ciudad de Calama. Se ofrece trabajo estable , empresa seria, pago sin retrasos ,crecimiento profesional. Pasaje de Ida a la ciudad en avión, auxilio de vivienda ,remuneración de acuerdo al mercado. Mínimo tres meses de prueba.Interesados favor enviar antecedentes indicando el cargo al que postula a talentohumano.calama@geotel.cl\r\n\r\n', 'talentohumano.calama@geotel.cl', 'Geotel Calama', 'www.geotelcalama.com', 'banner/Geotel.jpg', '2020-09-28 00:00:00', NULL, 1),
(348, 'Jefe de Administración y Finanzas', 'Nueva empresa hotelera en Las Condes requiere contratar Jefe de Administración y Finanzas. Deberá coordinar, supervisar y controlar la ejecución de los procedimientos\r\nadministrativos, financieros y contables que rigen el funcionamiento interno de la organización, optimizando los recursos asociados y asesorando en la toma de decisiones a la Gerencia. Se requiere: Mínimo 3 años de experiencia en funciones similares, Título técnico o Universitario en carreras de Ingeniería Comercial mención finanzas, Contador Auditor o similares acordes al cargo. Con manejo de Excel nivel avanzado y sistemas ERP. Orientado a la optimización y automatización de los procesos. Liderazgo y trabajo en equipo son indispensables. Favor enviar antecedentes con pretensiones de renta a pborges@talenttoserve.com', 'pborges@talenttoserve.com', 'Nueva empresa hotelera en Las Condes', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2020-10-15 00:00:00', NULL, 1),
(349, 'Mucamas', 'Nueva empresa hotelera en Las Condes requiere contratar mucama con alto nivel de energía para trabajar, \r\nedad entre 25 y 55  años,  buena actitud para atender requerimientos, prolijidad y honestidad.  \r\nFavor enviar antecedentes con pretensiones de renta a pborges@talenttoserve.com\r\n\r\n\r\n', 'pborges@talenttoserve.com', 'Nueva empresa hotelera en  Las Condes', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2020-11-05 00:00:00', NULL, 1),
(350, 'Mucamas y Aseadores', 'Nueva empresa hotelera en Las Condes requiere contratar mucama y aseadores con alto nivel de energía para trabajar, edad entre 25 y 55 años, buena actitud para atender requerimientos, prolijidad y honestidad. Experiencia en el rubro deseable. Favor mandar antecedentes indicando el cargo al que postula a pborges@talenttoserve.com.\r\n', 'pborges@talenttoserve.com', 'Nuevo Proyecto Hotelero Las Condes', 'www.talenttoserve.com', 'banner/400dpiLogoCropped.jpg', '2021-01-12 00:00:00', NULL, 1),
(351, 'Recepcionista', 'Hotel Boutique del sur de la Región Metropolitana, sector de Alto Jahuel, Buin,  busca Recepcionista con dominio avanzado del inglés, requisito excluyente. Contrato a plazo fijo, por 20 horas semanales. Favor mandar antecedentes indicando el cargo al que postula a pborges@talenttoserve.com.', 'pborges@talenttoserve.com', 'Hotel Boutique', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2021-02-01 00:00:00', NULL, 1),
(352, 'Gerente General', 'Hotel Boutique de 5 estrellas en Providencia busca incorporar a Gerente General con experiencia previa en aperturas y sólidas habilidades en Revenue Management. Postulante deberá dominar el idioma inglés. Favor mandar antecedentes a pborges@talenttoserve.com indicando el cargo al que postula. ', 'pborges@talenttoserve.com', 'Hotel Boutique 5 Estrellas', 'www.talenttoserve.com', 'banner/400dpiLogo.jpg', '2021-04-29 00:00:00', NULL, 0),
(353, 'Gerente de Hotel', 'Hotel The Singular Patagonia busca incorporar a Gerente de Hotel. Requisitos Excluyentes de Conocimientos y Experiencia: -Industrias: 3 años como mínimo en Hotelería remota de lujo (Entendiendo por lujo estándares de Leading Hotels )en posiciones de Gerencia de Hotel o Gerencia Residente o Gerente de Operaciones. -Áreas puntuales de Conocimiento: Servicio al cliente-Operaciones, Revenue y Reservas-Contabilidad, Finanzas y Presupuestos. -Herramientas Informáticas: Usuario avanzado -Idiomas: Inglés avanzado-3er idioma deseable. Favor mandar antecedentes indicando el cargo al que postula a pborges@talenttoserve.com\r\n\r\n', 'pborges@talenttoserve.com', 'Hotel The Singular Patagonia', 'www.talenttoserve.com', 'banner/logo singular patagonia.jpg', '2021-05-04 00:00:00', NULL, 0);
