(69, '<b>MAGIX GROUP<b/>', 'AV. Condell 1328 - Providencia - Santiago +562 2834 4300', '+562 2834 4300', 'candrade@magix-group.com', 'www.magix.cl', '18', 'Empresa de servicios Audiovisuales y soporte tecnológicos para Seminarios, Congresos, Ferias y Eventos corporativos. en Hoteles y Centros de Convenciones por medio de contratos In House de mediano o largo plazo,  o bien por eventos. Servicios en Chile (Santiago y regiones ), Colombia y México\r\n', 'banner/logo-magix.2jpg.jpg', 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(70, '<b>MUEBLES Y DISEÑOS S.A', 'Av. Santa Rosa 5721, San Miguel', '(562)2 9207175 - (562)2 920717', 'algomez@mueblesydisenos.cl  ', 'www.mueblesydisenos.cl', '22', 'Fabricación, armado de muebles, instalación, mantenimiento,  remanufactura de mobiliario y tapicería de sillas. Completo asesoramiento en el diseño y fabricación de mobiliario especial para diversas áreas tales como, financiero, salud, educación, gastronómico, entre otros. \r\n ', 'banner/Logo M&D.jpg', 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
