(74, 'e-Survey', 'Doctor Manuel Barros Borgoño #71, oficina 1105, Providencia', '+56977697447', 'contacto@e-survey.cl', 'www.e-survey.cl', '28', 'e-Survey es un completo sistema de información que permite capturar en tiempo real, mediante encuestas digitales, cómo los clientes están percibiendo una experiencia de servicio o un producto y pone a disposición esa información en un panel de control interactivo.', 'banner/e-surveyTtS.jpg', 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(75, 'e-Survey', 'Doctor Manuel Barros Borgoño #71, oficina 1105, Providencia', '+56977697447', 'contacto@e-survey.cl', 'www.e-survey.cl', '17', 'e-Survey es un completo sistema de información que permite capturar en tiempo real, mediante encuestas digitales, cómo los clientes están percibiendo una experiencia de servicio o un producto y pone a disposición esa información en un panel de control interactivo.', 'banner/e-surveyTtS.jpg', 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(76, ' <b>LA ESPECIERIA</b>', 'Holanda 3235, Ñuñoa', '+56977524648', 'contacto@laespecieria.cl', 'www.laespecieria.cl', '30', 'Productos nacionales e importados, aliños y te,  que cambian el olor, color, sabor, aroma, sazón,  para trasformar la gastronomía o repostería o bien su diario vivir en algo exquisito, diferente, exótico, con un toque que trasforma en algo especial. Manejamos mezclas, deshidratados, liofilizados,  molidos, escamas y  granos enteros.', 'banner/logo la especieria.jpg', 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(77, 'SERVICIOS CONTABLES HOTELEROS', '', '+56992183432', 'clausalgsuazo@hotmail.com', '', '17', 'Equipo de profesionales con más de 30 años de experiencia que ha trabajado en empresas Hoteleras e Inmobiliarias y entendemos todos los procesos que involucran esta actividad. Nuestro servicio incluye desde la externalización de la Gerencia de Administración y Finanzas a la liquidación de sueldos', 'banner/Curso-Contabilidad-Fiscal-Avanzada.jpg', 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00');
